INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (240, '2025-03-07 22:16:49', '2025-03-18 22:28:28', 'Y', 'Y', '2847537580', b'0', '약 50cm 정도의 무염색 닭깃털로 만든 냥냥부케입니다. 원레 저희집 고양이의 크리스마스 선물로 만든건데 너무 예뻐서 더 만들어보았습니다.  깃털부위는 부드러운 닭의 깃털에 스틱은 흔히 보시는 오뎅꼬지의 스틱보다 조금 더 빳빳하지만 잘 휘는 탄성있는 재질입니다  *스틱에 전처리와 실의 마무리 부분을 제외한 깃털고정부위는 접착제를 사용하지 않고 명주실로 하나하나 강하게 감아 고정하여 웬만큼 흔들어서는 깃털이 빠지지 않지만, 혹시나 아이가 깃털을 많아 물어뜯는다면 5~6개 가량 빠진 이후 전체적으로 풀려버릴 수 있습니다. 해당 사항이 걱정되시면 옵션에 <글루처리O>선택하시면 주문 후 제작이니 그렇게 마감해드린답니다 :) (이경우는 안쪽 대부분은 아이가 물지 않도록 해주세요)  * 옵션은 방울 없음/방울 추가 두가지입니다 * 방울 없음 - 방울이 없습니다. 방울 있음 - 딸랑거리는 탈부착 가능(고리달림) 방울과 방울을 달 수 있는 고무줄이 추가됩니다. 방울은 낚시대 등에도 달아서 사용이 가능하십니다.  size : 약 50cm 내외(깃털부분 15cm/스틱부분 35cm) 재료 : 무염색 닭깃털 2종, 면실, 록타이트 글루, 스틱) (제품 컬러는 자연물의 특성상 조금씩 다를 수 있으며. 사이즈 또한 어느정도 상이할수 있습니다)', 6900, 0, 'N', 'Y', '50cm 냥냥부케(2~3일 소요)', 6900, 99, 12, 5);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (239, '2025-03-07 22:16:49', '2025-03-18 22:28:28', 'Y', 'Y', '2606755063', b'0', '고양님들 너무좋아하는 장난감 매듭공에 캣닢을 담았어요   마크라메 매듭볼은 견고하고 스크래쳐감이 뛰어납니다  공안에 내장된 캣닢가루는매듭사이로 향이올라와 장난감 흥미에 배가되어요  캣닢향이 솔솔 🍃🍃기능성에 예쁨은덤 🤍   작은볼2+큰볼1 / 작은볼1+큰볼2 / 큰볼3 / 작은볼3  ✨ 파스텔컬러와 비비드원색 16색상중 예쁘게 섞어보내드립니다 어떤색끼리 만나도 너무예쁜 색감이에요🫶🫶  NEW💛줄추가 Ver💛 3p 공에 80cm길이의 긴줄이 이어져있어요 캣타워 /터널 어디든 묶을수 있고 냥이들의 가지고놀기에 그립감도 훨씬 편합니다 줄버전은 추후에 줄을 자르면 기본공으로 재탄생🌈', 10800, 0, 'N', 'Y', '예쁨에향기까지💚캣닢매듭볼 장난감공3셋', 10800, 99, 12, 5);
