INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (236, '2025-03-07 22:16:46', '2025-03-18 22:28:28', 'Y', 'Y', '6794823440', b'0', '🐶🐱 🌸 꽃토끼 케이프, 토끼모자 🐰  (모자,케이프 옵션에서 각각 선택해주세요)  귀여운 토끼모자는 스토퍼가 달려 있어 얼굴 사이즈에 맞도록 조절이 가능합니다  케이프는 똑딱단추로 착용이 편하며 보들보들한 뽀글이 원단으로 가볍고 따뜻해요   [🔔케이프 사이즈🔔] 사이즈 - 케이프 둘레 - 추천몸무게 S - 23 ~ 24cm - 1~2kg M - 26 ~ 27cm - 2~3kg L - 29 ~ 30cm - 4~6kg XL - 31~ 32cm - 6~8kg 케이프를 펼쳐서 잰 사이즈입니다* 아이 목둘레에서 2~3cm 여유있는 사이즈로 선택해 주세요  [🔔모자 사이즈🔔] 머리둘레 - 추천몸무게 S - 20~23 - 1~2kg M - 24~28 - 3~4kg L - 29~32 - 5~6kg XL - 32~35 - 7~8kg', 15000, 0, 'N', 'Y', '꽃토끼 🐰 강아지 케이프 토끼모자 겨울옷 🐇', 15000, 99, 10, 5);
