INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (201, '2025-03-07 22:16:15', '2025-03-18 22:28:28', 'Y', 'Y', '7703481768', b'0', '오직 아이디어스에서만 볼 수 있는 폭스펫 수제간식을 소개 합니다  ?폭스펫 수제간식 안내?  1. 좋은 원료만을 사용합니다 신선한 국산 원료만을 수급하여 제조합니다  2. 순수 원물만으로 제조됩니다 아이들마다 개별로 알러지 차이가 있기 때문에 첨가제나 방부제 없이 단일 원료만을 100% 사용하여 제조됩니다  3. 냉장고에 넣지 마세요. 상온 보관 가능합니다 냉장/냉동 보관 시 수분 유입으로 인하여 부패가 될 수 있기 때문에 모든 간식은 상온에 보관하여 주세요.  *직사광선은 피해주시고 건냉한 곳에 보관해 주세요(ex. 식탁 위, 펜트리)  4. 긴 유통기한으로 취급이 편함 모든 수제간식은 18개월간의 긴 유통기한을 가지고 있습니다 오염 걱정 없이 급여하세요   ?수제 건조 간식 수분량 제대로 알고 삽시다!? 1. 폭스펫 수제간식은 왜 아이스박스에 담아주지 않나요? 2. 폭스펫 수제간식들은 왜 냉장 보관이 아니라 상온 보관인가요? 저희가 자주 듣는 질문인데요  ?️정답은 수분율에 따라 결정됩니다 폭스펫 수제간식의 경우 수분율 16%미만으로 건조되어 상온 보관이 가능하고 아이스박스에 포장하지 않아도 됩니다. *법령 및 규칙으로 정하고 있는 부분입니다', 1000, 0, 'N', 'Y', '강아지수제간식 뼈간식 치석제거 오리목뼈 50g', 1000, 99, 6, 5);
