INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (197, '2025-03-07 22:16:12', '2025-03-18 22:28:28', 'Y', 'Y', '0796730185', b'0', '👏 비프테린 3대 효능 - ✔ 근육강화/기력회복/철분뿜뿜    ✔ 비프테린은 - 지방이 없는 홍두깨살 부위를 사용하여 스팀 조리법으로 만들었어요. 스팀 조리법은 고기를 연화시켜 퍽퍽한 살코기를 부드럽고 촉촉하고 만들어주며, 칼로리를 낮춰주고 영양소 손실까지 최소화 해주는 조리법이예요.   육류 75% 채소 25% 비율로 만들어지는 테린은 아이들의 한끼식사로도 급여가 가능해요.   펫만찬의 테린은 부드러운 식감과 육즙을 가득품고 있어  아이들에게 높은 기호성을 자랑하는 간식이예요.', 7900, 0, 'N', 'Y', '🏆한끼식사 비프테린🏆 강아지간식', 7900, 99, 6, 5);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (196, '2025-03-07 22:16:10', '2025-03-18 22:28:28', 'Y', 'Y', '3349670693', b'0', '🏆반려동물 수제간식 부문 우수 작가상 수상🏆 - 펫만찬의 모든 간식은 깐깐하게 엄선된 신선한 식재료로 하나 하나, 정성을 담아 직접 제조합니다. 👏 오리테린 3대 효능 - ✔ 기력회복/혈액순환/피부건강    ✔ 오리테린은 - 지방이 없는 오리안심 부위를 사용하여 스팀 조리법으로 만들었어요. 스팀 조리법은 고기를 연화시켜 퍽퍽한 살코기를 부드럽고 촉촉하고 만들어주며, 칼로리를 낮춰주고 영양소 손실까지 최소화 해주는 조리법이예요.   육류 75% 채소 25% 비율로 만들어지는 테린은 아이들의 한끼식사로도 급여가 가능해요.   펫만찬의 테린은 부드러운 식감과 육즙을 가득품고 있어  아이들에게 높은 기호성을 자랑하는 간식이예요.', 6900, 0, 'N', 'Y', '🏆한끼식사 오리테린🏆 강아지간식', 6900, 99, 6, 5);
