INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (193, '2025-03-07 22:16:07', '2025-03-18 22:28:28', 'Y', 'Y', '6440261160', b'0', '🪅🥨헤링본 돋보이는\n리투아니아 수입린넨 원피스예요\n🌿\n프리미엄설명글을 더보시면\n목부분이 프릴이 잡혀\n귀엽고도 우아합니다ㅡ\n넓직한고무가 편안하게 목을\n잡아주지요\n🍨🍃\n길이는\n목부분에서 끝단까지120cm입니다\n벨트를 메지 않을땐\n너무너무 편안한\n스타일이고\n허리를 묶었다 하면^^\n완전히 다른\n스타일로 변신되는거죠ㅎ\n리조트에서도 좋고\n편안한 모임자리\n그러나\n또\n분위기잡는자리에서도\n고운~결이 돋보이는 고급 린넨\n원피스입니다ㅡ\n깊은주머니가\n안정감이있어요\n색은ㅡ🥝깊은초록\n🌿쑥색\n🎈베이지\n골라보아요\n벨트가 함께 있어요\n※소품ㅡ세라 케이프 머플러(비단가게)', 320000, 0, 'N', 'Y', '원픽[리투아니아 린넨]목셔링 브이넥 헤링본원피스', 320000, 99, 32, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (192, '2025-03-07 22:16:06', '2025-03-18 22:28:28', 'Y', 'Y', '3207487429', b'0', '🖤하나로 편하게 블랙 프릴 원피스🖤\n‼️M,L사이즈 품절‼️\n\n좀 더 날씬해보이는😉\n단독으로 입어도\n레이어드해도 어디에나 잘 어울리는 블랙입니다\n\n비침이 적어 보송보송 부드러운 원단의 느낌 그대로\n편하게 입기 좋구요\n넉넉한 품으로 러블리한 베이비돌 원피스🤍\n\n\n목과 소매 부분의 러블리한 프릴이 포인트로 심심하지 않고\n목 부분의 끈을 당겨서\n내가 원하는 핏으로 입을 수 있어 활용도가 높아요^^\n품과 암홀을 매우 크고 깊게 만들어 정말 편하답니다\n😉', 72000, 9, 'N', 'Y', '🖤블랙 프릴 원피스', 80000, 99, 32, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (191, '2025-03-07 22:16:05', '2025-03-18 22:28:28', 'Y', 'Y', '5101609162', b'0', '제작기간 2-10일 소요되니, 여유롭게 주문 부탁드립니다☺️\n\n가슴에 핀탁으로 주름을 잡아\n포인트를 주어\n편안하고 멋진 린넨 원피스입니다\n\n옥색(린넨)\n네이비(면 린넨)-옥색과 레드보다 톡톡합니다\n레드(린넨)\n\n3가지 색상 모두 멋진\n린넨만이주는 이쁜색감입니다\n\n✔️\n사이즈\n가슴단면 56cm\n어깨단면 40cm\n소매길이 42cm/47cm\n소매단면 19cm\n암홀 24cm\n총장(어깨-밑단) 112cm\n뒤 목트임 단추\n\n*1-2cm의 오차가 있을 수 있습니다*\n\n모델 키 160cm\n\n린넨 세탁시 건조기X 섬유유연제X', 120000, 0, 'N', 'Y', '린넨 핀탁 원피스', 120000, 99, 32, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (190, '2025-03-07 22:16:05', '2025-03-18 22:28:28', 'Y', 'Y', '4143882957', b'0', '데일리스티치에서만 만나볼 수 있는 데일리 원피스를 소개합니다.\n데일리스티치 인기 원피스 TOP3 안에 드는 원피스를\n이번엔 봄,가을에도 입으시라고 린넨 원단으로 제작되었습니다.\n\n​\n일자로 떨어지는 핏과 롱한 기장금으로 체형커버에도 좋구요\n린넨의 적당한 두께감으로 부해보임 없이 예쁜 실루엣을 만들어 준답니다.​\n\n둥근 카라와 상체 부분 단추 디테일로 포인트를 주었고\n전체적으로 편안한 핏과 롱한 기장감으로\n실내 및 야외 활동하기 좋은 원피스입니다.', 99000, 0, 'N', 'Y', '동백 플랫 카라 버튼 린넨 원피스', 99000, 99, 32, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (189, '2025-03-07 22:16:04', '2025-03-18 22:28:28', 'Y', 'Y', '8586722560', b'0', '💚사랑하는 가족들과 친구들과 홈파티 어떠세요~?\n\n♥️저희 원피스와 아주 찰떡! 궁합인 디자인으로\n수많은 샘플을 보고 나온 최종의 최종의 최종😇\n앞치마가 사실 거기서 거기인 것 같지만\n저희 온리휴 프릴 원피스와 아주 찰떡! 궁합으로 어우러지도록\n그리고 다른 어떤 옷에 입어도 편하게 잘 어울리도록 노력했어요~\n\n아무래도 옷을 만드는 사람이다 보니 옷과 똑같이 신경써서 디자인했습니다\n그래서 그런지 사실 저는 그냥 레이어드 조끼 원피스로\n외출시에도 자주 입고 있답니다:)\n크리스마스날 집에서 하는 홈파티♡ 생각하며 앞치마로 내게되었어요~~~\n\n\n그런데 여러분! 혹시 앞치마를 입을 때 신경쓰시는 부분이 있나요?\n저는 개인적으로 앞치마를 입었을 때 가슴 옆부분이 붕 뜨는 것을 굉.장.히 안 좋아하는데요ㅎㅎㅎㅎ\n그걸 최대한 잡기 위해 라인에 신경 썼구요!👍\n(그래서 이렇게 샘플을 많이 뽑았던..!)\n그리고 포근한 기모면에 앞뒤 양면으로 레이어드 되어서 \n어깨 부분 또한 전혀 흘러내리지 않아 편하고\n조금 더 따뜻하게!😊\n앞뒤 양면도 똑같은 면 2개를 그냥 이어붙이지 않았습니다\n뒷모습도 예뻐야 하기 때문에 넥을 조금 더 높게 올렸구요~\n(뒤에서도 길고 슬림해 보이도록..!)😉\n허리부분 절개 주름 셔링도 허리가 너무 길어보이지도,\n그렇다고 상체가 너무 깡뚱해 보이지도 않을 기장으로 찾았답니다ㅎㅎㅎ😙\n치마폭도 언제나 처럼 아끼지 않고 넉넉하게 만들었죠😎\n앞치마는 대부분 실내에서 착용하지만\n아무래도 겨울이고 크리스마스 분위기를 물씬 풍기기위해\n기모가 느껴지는 원단으로 너무 두껍진 않지만 포근한 감촉~', 55000, 8, 'N', 'Y', '❤️ 체크 원피스 앞치마', 60000, 99, 32, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (188, '2025-03-07 22:16:03', '2025-03-18 22:28:28', 'Y', 'Y', '7660442881', b'0', '안녕하세요\n꼼꼼한 전문가의 패브릭 핸드메이드 공방\n재봉이입니다☺️\n\n가벼운 청지로 만든 앞치마에요 :)\n일반 가정이나 카페, 공방 등\n두루두루 잘 어울리는 디자인으로 제작하였어요\n\n셔링이 없이 일자로 떨어지며 하체를 감싸주어\n정말 날씬해보인답니다\n\n청원단이지만 무겁지 않아\n하루종일 앞치마를 입으시는 분들도\n편하게 착용하실 수 있습니다💕\n\n개업, 집들이, 결혼같은 선물용으로도 좋으실거에요\n\n고리형태와 어깨끈 형태 두가지 중 선택하실수 있으며\nO형 제품의 목 끈의 길이는 매듭으로\n조절할 수 있습니다\n\n목에 거는게 불편하신 분들을 위해\n어깨끈 형태로도 제작되었습니다\n앞치마 착용시간이 긴 분들은 좀 더\n편하게 착용 하실 수 있으실거에요😉\n\n허리에 끈을 둘러서 묶어주시면 날씬해보이고\n뒤로 묶으시면 널널한 앞치마로 착용하실수 있습니다', 39000, 9, 'N', 'Y', '[재구매율👍]날씬해보이는 청청 앞치마 평점 5점', 43000, 99, 32, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (187, '2025-03-07 22:16:00', '2025-03-18 22:28:28', 'Y', 'Y', '6078927761', b'0', '안녕하세여~\n최고급 원단과 최고급 바느질로 나만의 커스텀 맞춤 앞치마\n"린다의 앞치마" 입니다.\n\n🥰🥰히트신상이 또 나왔어요^^\n어디에서도 볼 수 없는 고급진\n브이넥으로 한층\n멋스럽게 표현 해 보세요.\n나만의 커스텀 앞치마로 여러분을\n최고의 멋쟁이로 만들어 드릴게요^^👍\n\n😍브이넥 맥시롱~~~기장으로\n선보인 원피스형 앞치마는\n앞 뒤로 둘다 입을 수 있어요.\n(👍👍많은 분들의 주문으로 엄청 인기폭발 이네요.)\n\n옆라인에 제천의 긴 끈을 달아 편하게 입을 수 있어요.\n\n🥰❤️저희 작품은 몸 체형 커버 날씬해 보일 수 있도록\n제작 되어 특히 하체 커버 하기엔 최고의 디자인 입니다.\n\n🙆‍♀️어디서나\n바로 요아이들만 꺼내 입으시면\n걱정 없이 멋스러움 그대~로 외출 하실수 있어요^^\n\n고급스럽고 멋스러워 셀카를 부르는…\n*사계절 다 입으실 수 있고요^^\n\n🙀😍최고급 국내산\n워싱 린넨 면100%\n가볍고\n구김도 적어 실용적으로 입을 수 있어요.', 59000, 0, 'N', 'Y', '🙀🌹핫)유니크한 브이넥맥시롱원피스앞치마', 59000, 99, 32, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (186, '2025-03-07 22:15:59', '2025-03-18 22:28:28', 'Y', 'Y', '5917241443', b'0', '💓혼용률 폴리 64% 레이온 33% pu폴리우레탄 3%\n\n약간의 두께감이 있고 기모가공을 한 레이온이 포함된 고급원단이라 감촉이 매우 포근하고 부드러워요.\n원단의 감촉이 아주 부드럽지만 정전기방지 안감까지 넣어 피부에도부드럽고 감기지 않아 좋아요.\n치마폭은 원단을 넉넉하게 사용하여 주름을 잡아 볼륨감이 있어요.\n\n🌸저고리와 함께 입으시면 넘~~~예쁘죠.\n포근한 니트나 블라우스 또는 슬림티셔츠와 예쁘게 입어보세요.\n\n추운 겨울이라고 스타일이 부~하게 두꺼워 보이면 싫잖아요.\n단미의 철릭원피스로 따뜻하게 날씬하게 스타일을 연출하실 수 있어요.\n\n💝단미의 바늘꽃이야기는 한벌한벌마다 정성을 다해 꼼꼼하게 직접 제작합니다.\n그래서 더욱더 퀄리티있고 소량제작판매라 나만의 희소성이 있습니다.\nOEM방식으로 대량생산판매하는 생활한복과는 다른 특별한 차별성이 있어요.', 100000, 33, 'N', 'Y', '단미 민소매철릭윈피스(그레이)', 150000, 99, 32, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (185, '2025-03-07 22:15:57', '2025-03-18 22:28:28', 'Y', 'Y', '5900248714', b'0', '🩰🧃🍵가늘고 긴 끈이 너무너무 ~~\n여리여리해 보이죠?\n세상의 모든 여인들이\n여리 여리 를 꿈꾸어요\n🌺🥕\n뒷태는 얼마나~~예쁘게요?\n두끈을 잡고 당기면 주름과함께\n볼륨이 살아납니다ㅡ\n리본으로 묶어도예쁘고\n🌿🍃\n길게~~~~\n바람에 흔들리도록\n질끈 묶어두어도 좋아요\n🪅🥨\n숨은 입술주머니가 있어서\n차키든 핸드폰이든\n넣기편하고\n어색한 손ㅎ 감추기에도\n안성맞춤💍\n🎈벚꽃놀이에 맞춤의상이기도 해요\n여리 여리..여성.여성\n가늘어보이는 매직!!!!🧃\n참📌📌까페에서든 예쁜 음식점에서\n에이프런으로도\n완전 멋짐폭발🥦🥦\n\n애기 유치원보내놓구서\n맘들과의 커피타임에\n단연 돗보이는 실루엣...\'\n경험해 보아요', 137000, 0, 'N', 'Y', '슬리브리스 백볼륨 리본 주머니 원피스(린넨3종)', 137000, 99, 32, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (184, '2025-03-07 22:15:56', '2025-03-18 22:28:28', 'Y', 'Y', '1438749629', b'0', '손으로 달콤함을 선물하는 비터스윗손뜨개 입니다🐝\n\n\n추워지는 겨울 아이 카디건을 만들어 왔어요\n동글동글 꽈베기 무늬에\n떡볶이 단추를 달아 너무 귀엽답니다\n\n세트로 작은 손가방도 같이 만들어왔습니다😆\n\n주 면소재로 부들부들하고 아주 따뜻하답니다\n\n📐위 사진 사이즈 샘플은 3~4세용 입니다\n\n📏카디건 58,000원\n품: 38cm\n총 기장: 38cm\n팔길이: 30cm\n\n📏가방 16,000원\n가로: 16cm\n세로: 15cm\n\n✔️세트로 구매시 총 68,000원 입니다\n\n다른 사이즈를 원하시면 메세지로 문의해 주세요✉️\n\n🌈색상\n베이지\n\n✔️미지근한 물에 중성세제로 손세탁 해주세요.', 61000, 0, 'N', 'Y', '손뜨개 아이 카디건', 61000, 99, 31, 4);
