INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (182, '2025-03-07 22:15:55', '2025-03-18 22:28:28', 'Y', 'Y', '4994721863', b'0', '태극기의 현을 모티브로 제작된 건곤감리 감 항공점퍼\n등의 건곤 "감" 리 의 감현을 디자인하여 제작되었습니다.\n\n감 항공점퍼는\n생활방수가 되는 나일론 원단\n보풀이 나지 않고 오래 사용가능한 시보리\nykk 최고급 지퍼\n면과 폴리 레이온의 혼합으로 오랜사용이 가능한 후드\n하스 4온스본딩을 한 투일 안감\n모든 것을 고급 자재들만으로 제작되었습니다.\n\n※감 항공점퍼는 후드가 있는 버전과 없는 버전 두가지로 나뉘어져 있습니다.※\n\n블랙 색상 ▶ 그레이 색상후드\n그레이 색상 ▶ 블랙 색상후드\n아이보리 색상 ▶ 화이트 색상후드\n\n와x즈 크라우딩 펀딩으로도 많은 사랑을 받아\n2차앵콜까지 성공한 항공점퍼!\n시즌 오프 전까지 할인을 진행합니다.\n현재 미리 제작된 의류 이후에는\n주문 제작 되어 1 ~ 5일 소요 될 예정입니다.', 91000, 54, 'N', 'Y', '건곤감리 감 항공점퍼', 198000, 99, 31, 4);
