INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (179, '2025-03-07 22:15:53', '2025-03-18 22:28:28', 'Y', 'Y', '4337458063', b'0', '오버핏에 너무너무 예쁜 후드집업 니트 원하시나요?\n그럼 이 아이 강추입니다.\n팬츠, 스커트 다 잘 어울리니 고민하지 마세요~^^\n후회 없는 선택을 하실거예요\n~^^\n👚size는44~작은88까지 가능한 프리 사이즈,오버핏니트\n기다리시는 분 계신가요❓❓❓\n-\n모델 사이즈\n163cm/54kg\n착용싸이즈: Free\n-\n상동 전체: 152 cm\n총 기장: 63 cm\n화장 기장: 72 cm\n소매 기장: 40 cm\n-\n두께감: 보통 두꺼움\n-\n세탁시 꼭 찬물에 울세제를 사용하여 주시고,\n(물세탁은 줄어들수 있음)\n드라이클리닝을 추천드립니다.\n-\n주문후 제작이 들어가는 제품은\n최대 7일 소요 될 예정입니다.\n-\n1~2cm 의 치수차이,\n화면 해상도에 따른 실물과의 컬러 차이가 있을 수 있으니\n양해 부탁드립니다.', 120000, 0, 'N', 'Y', '블랙 후드집업 니트 코트', 120000, 99, 31, 4);
