INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (177, '2025-03-07 22:15:51', '2025-03-18 22:28:28', 'Y', 'Y', '8007058882', b'0', '🍃요즘 처럼 일교차가 심한 날 가볍고 멋스럽게 걸치기 딱 좋은 스타일🍃\n\n💙한복 저고리 느낌이 나는 로브💙\n리투아니아 린넨 로브 자켓입니다\n\n2way로 연출이 가능해서\n1벌로도 2벌 효과를 느낄 수 있답니다😍\n\n‘한복의 깃’ 느낌을 내서 살린 넥라인에 끈을 넣었어요~~~~\n셔링 없이 툭 걸치면 시크하고 한국적인 분위기 물씬♡\n끈을 살살 당겨서 주름을 잡아주면 굉장히 귀엽고 러블리한 스타일로도 연출이 돼요!\n끈은 리본을 묶거나, 한번만 묶어서 늘어뜨려도 좋습니다:-)\n\n원단은 리투아니아 린넨으로 매우 고급스럽고 일관되지 않게 살짝 섞인 컬러가 유니크한 포인트를\n더해줍니다🤗\n\n같은 원단으로 통이 넉넉한 반바지도~~\n세트로 입어도 귀여운 매력이 살고,\n따로, 저희 박시5부티,민소매 등등 어디에나 찰떡!\n\n시원하게 들러붙지않는 린넨이라\n외출용으로 레이어드하기에도\n한여름엔 에어컨 밑에서 찬바람 피하기에도 좋아\n🍀4계절 언제 입어도 활용도가 높아요🍀', 115000, 11, 'N', 'Y', '(2way)리투아니아린넨 한복 로브', 130000, 99, 31, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (176, '2025-03-07 22:15:50', '2025-03-18 22:28:28', 'Y', 'Y', '0838200489', b'0', '캐시미어 원단으로 만든 핸드메이드 케이프 입니다.\n\n\n디테일을 많이 넣지 않아도 원단 자체에서 주는 은은한 광택감과\n\n포근한 느낌이 캐시미어의 매력인 것 같습니다.\n\n이런 캐시미어의 포근함을 최대한 살릴 수 있게\n\n앞 겹침분과 옆선, 전체적으로 원단을 충분하게 사용해\n\n따뜻하면서도 드레이프가 멋지게 생기도록 디자인 했습니다.\n\n\n엉덩이를 덮는 길이, 소매는 9부 입니다.\n\n55, 66 두가지 사이즈로 진행합니다.\n\n제작일은 7일정도 소요됩니다.\n\n키와 몸무게, 신체 특이사항(ex. 팔길이등) 을 알려주시면 반 맞춤으로 진행합니다.\n\n사진은 168cm 66사이즈 착용컷입니다.\n\n55사이즈- 총기장:74cm, 소매길이:60cm(목옆선~끝),밑단단면:103cm\n66사이즈- 총기장:79cm, 소매길이:61cm(목옆선~끝),밑단단면:113cm', 320000, 0, 'N', 'Y', '핸드메이드 케이프 판쵸', 320000, 99, 31, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (175, '2025-03-07 22:15:49', '2025-03-18 22:28:28', 'Y', 'Y', '5970236300', b'0', '​데일리스티치가 자체개발한 원단으로 제작한\n포근하게 입을실 수 있는 누빔 가디건을 소개해드려요\n\n플라워 패턴의 가볍게 걸쳐 입기 좋은 가디건입니다.\n\n너무 두껍지 않고 가벼워서 겨울로 가기 전에는 아우터로 사용하시면\n정말 좋으실 거 같아요\n집안에서도 편안하게 실내복으로도 입으셔도 되고요\n\nFREE (55-66)로 나왔으나 77사이즈까지 가능합니다\n\n면 누빔 소재에 데일리스티치에서 제작한 동백 자수를 수놓아\n포인트 주기 예쁜 가디건이랍니다\n\n내가 입어도 좋고,\n선물로도 센스 만점인 누빔 가디건으로\n소중한 분에게 선물드리면 좋을 거 같아요\n\n​\n[색상]\n화이트, 블랙\n\n\n[사이즈]\nFREE (55-66)\n77까지 입으시기 넉넉한 사이즈 입니다.\n(재단 방법에 따라 1~3cm 오차가 있을 수 있습니다.)\n\n​\n소재\n면누빔', 69000, 0, 'N', 'Y', '동백 자수 누빔 가디건', 69000, 99, 31, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (174, '2025-03-07 22:15:47', '2025-03-18 22:28:28', 'Y', 'Y', '0611997268', b'0', '＊ tolivetoo_투립투\n우리 모두에게 더 큰 행복으로 이어질 수 있다는 상상을 하며,\n즐겁고 행복한 마음으로 모든 과정에 임하고 있습니다.\n\n\n[ 브라운 체크슬랙스 / S,M ]\n\n제가 오랜기간 옷가게를 운영했을 때 많은 옷들을 다루다보니\n은근히 호불호가 많이 갈리는 게 체크바지였어요~!\n\n추천드릴 때 대부분 돌아오는 대답이 뭔가 멋쟁이들만 입어야 할 것 같고,\n입고는 싶은데 어렵다는 반응이 참 많았었어요~!\n이번 첫 체크슬랙스를 제작하면서, 그 때 그 고객님들을 떠올리며 임했습니다.\n\n1. 부하지 않아보이는 핏\n2. 부드럽고 가벼운 착용감\n3. 허리 여밈의 편리함\n\n그리고 추가적으로 색감의 고급스러움을 고려해 원단과 부자재를 선별했어요!\n투립투의 체크슬랙스로 이번엔 한번 꼭 체크바지 도전해보세요! ♥\n\n허리의 사이즈는 단추이동으로 조금씩 조율이 더 가능한 점 참고해주세요~!!\n\n- 소재\n폴리 65, 레이온 35\n\n- 사이즈(cm)\n[ ﻿S ] 허리단면 32.5, 엉덩이 단면 46, 밑위길이 34, 허벅지단면 28, 총기장 100\n[ ﻿M ] 허리단면 34, 엉덩이 단면 48, 밑위길이 34, 허벅지단면 29, 총기장 100\n\n- 케어\n착용후 물세탁 가능\n\n﻿- 모델 사이즈\n신장 165cm, 상의 55, 하의 S', 59400, 0, 'N', 'Y', '브라운 체크슬랙스 / S,M', 59400, 99, 30, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (173, '2025-03-07 22:15:42', '2025-03-18 22:28:28', 'Y', 'Y', '2499660745', b'0', '어디서든 간편하게 입기 좋은 블랙🖤\n넉넉하고 멋스러운 핏과 탄탄한 소재감으로 편하면서\n☀️집 안에서 입기에도 좋을 뿐만아니라\n🤸‍♂️외출시에도 그대로 나가기 무리없는 간편한 원마일웨어\n\n7부M,L\n긴기장S,M,L,XL\n다양한 체형을 고려한 다채로운 사이즈🥰\n\n직접 입어보면 느껴지는 고퀄리티 원단\n부드러우면서도 편한 감촉에 고급스러운 짙은 블랙!\n비침이 적어 외출시에도 무리없고\n주머니가 비쳐보이지않아서 많은 분들이 원하시는\n주머니도 추가😘\n\n사진에 모델이 같이 착용한 옷들도 모두 온리휴!\n끈나시블라우스, 긴팔, 반팔 박시티셔츠\n모두 같은 원단~~\n레이어드할 수록 멋스럽고 취향에 따라\n세트 느낌으로 입기좋습니다♡\n\n요즘에 온라인 수업이 늘어난 학생분들🤓\n재택근무로 화상, 줌 회의가 잦은 직장인분들도😎\n특히나 너무 좋아해주셨는데요~\n집에서 계속 입고있기 편하면서도\n너무 잠옷같지만은 않은 디자인이라 더 만족도가 높았답니다^^\n정말 \'편하고\' 또 \'편하게\' 만드는데 중점을 뒀어요👍\n허리밴딩도 굉장히 편하고요!\n귀여운 택은 일부러 "겉면뒤"', 39000, 13, 'N', 'Y', '🖤남녀공용 블랙 긴바지 홈웨어', 45000, 99, 30, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (172, '2025-03-07 22:15:42', '2025-03-18 22:28:28', 'Y', 'Y', '8691366102', b'0', '■ 디자인 포인트 ■\n\n✅데일리 아이템인 조거팬츠로\n신축성 좋은 허리밴딩으로 마무리\n✅입은듯 안입은듯한 편안함에 전체적으로\n슬림하게 보이는 핏이 포인트\n✅홈웨어, 운동복 등 다양하게 활용 가능한 팬츠\n\n**민트컬러는 품절입니다**\n\n----------------------------------------------\n\n이프지오의 모든제품은 국내생산을 기반으로\n하고 있으며, 보다 나은 디자인과 품질을 제공\n해드리기 위해 노력하고 있습니다.\n\n\n✅FABRIC\n면 100%\n\n✅MODEL\n신장 167cm\nTOP 55 size\nBOTTOM 26 inch\n\n✅COLOR\n민트(품절), 메란지그레이, 블랙\n\n✅Size (Free)\n총장: 98cm\n허리: 31 cm\n힙: 47 cm\n\n\n📍위의 실측사이즈는 \'단면 사이즈\'입니다.\n측정방법에 따라 1~3cm의 오차가 있을 수 있습니다.\n제품 색상은 모니터 사양에 따라 차이가 생길 수 있습니다.\n\n📍정성껏 검수후 포장하여 보내드리지만 하루,이틀정도\n포장이 된 상태에서 배송이 되다보니 받으셨을때\n구김이 생길 수 있습니다.\n구김이 많이 간 상품은 착용 전, 물 스프레이나\n스팀 다림질 후 입어주세요~\n\n✅배송\n재고 보유 상품은 당일 3시 주문을 기준으로\n당일출고 됩니다. 품절 제품의 경우 사전고지를\n하고 있으며, 재고소진 시 재생산하는\n기간이 10~14일가량 필요합니다.\n준비되는대로 제일 먼저 보내드릴께요^^', 29500, 4, 'N', 'Y', '[ifg5] 푸푸 조거 팬츠', 31000, 99, 30, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (171, '2025-03-07 22:15:41', '2025-03-18 22:28:28', 'Y', 'Y', '8761705710', b'0', '[아카이브/B급 할인]\n\n\nINSIDE-OUT DENIM PANTS\n인사이드아웃 데님 팬츠_블루\n사이즈: 스몰, 미디움\n\n정말 많은 사랑을 받았던 유니크한 디자인의 비트윈에이앤비 인사이드아웃 데님 팬츠입니다. 원단의 안과 밖을 뒤집어 배색하였고, 9부 기장의 바지로 앞,뒤 길이의 차이를 두어 디자인에 포인트를 주었습니다. 살짝 여유있는 루즈핏으로 입었을 때 다리를 날씬하게 잡아주어 활용도가 높으며 적당한 두께의 소재로 여름을 제외한 전 시즌 착용 가능한 데일리 팬츠입니다.\n\n이번에 아카이빙된 상품 정리 중 생각보다 많은 상품들이 발견되어,\n추석기간 동안 아이디어스에 단독으로 아카이빙 세일 판매 진행됩니다\n\n대부분 촬영 및 협찬 진행되어,\n저희 브랜드에서 자체적으로 B급 품목으로 빼놓은 작품으로\n착용하시는데는 문제가 없습니다.', 24000, 62, 'N', 'Y', '[B급/아카이브 세일] 인사이드아웃 데님 팬츠 [블루]', 64000, 99, 30, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (170, '2025-03-07 22:15:40', '2025-03-18 22:28:28', 'Y', 'Y', '2024459921', b'0', '포켓과 헴라인에 더미라리 레이스로 디자인포인트 🆙\n포켓에 프랑스자수로 디테일 포인트 🆙\n3년 동안 쭉~ 인기있는 이 아이는\n여름에는 얇게, 겨울에는 두껍게 진행됩니다.\n\n55~66까지 가능한 프리 사이즈👖\n기다리시는 분 계신가요❓❓❓\n-\n모델 사이즈\n163cm/54kg\n착용싸이즈: Free\n-\n총 기장: 88 cm\n엉덩이 둘레: 110 cm\n-\n두께감: 보통\n-\n세탁시 꼭 찬물에 울세제를 사용하여 주시고,\n(물세탁은 줄어들수 있음)\n드라이클리닝을 추천드립니다.\n-\n주문후 제작이 들어가는 제품은\n최대 7일 소요 될 예정입니다.\n-\n1~2cm 의 치수차이,\n화면 해상도에 따른 실물과의 컬러 차이가 있을 수 있으니\n양해 부탁드립니다.', 89000, 0, 'N', 'Y', '레이스포인트 9부 팬츠', 89000, 99, 30, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (169, '2025-03-07 22:15:39', '2025-03-18 22:28:28', 'Y', 'Y', '9665809165', b'0', '요즘 밤잠 못 드시는 분들 계신가요?🥺\n불면증 바지!\n편한 핏과 부드러운 촉감으로 꿀잠 필수템🌜\n\n✨내 피부가 좋아하는 온리휴 광목 시리즈\n드디어 많은 분들이 💓커플룩, 가족룩💓\n으로 기다려주시고 요청해주셨던\n남성분들을 위한 긴바지!\n\n🤍오버핏의 코지룩을 좋아하시는 분이면 누구나🤍\n\n모델이 같이 착용한\n박시5부티셔츠도 같은 원단으로 만들어서\n세트로도 각각으로도 활용성 굿\n광목 헨리넥 셔츠와 반바지도 있으니 둘러보세요☺️\n\n정말 \'편하고\' 또 \'편하게\' 만드는데 중점을 뒀답니다👍\n택은 일부러 \'뒷면 겉\'에 붙였어요\n혹시나 조금이라도 거슬리거나 베겨서 불편한 분이 없도록😊\n온리휴 잠옷 바지 입고 편한 밤 되시기바랍니다\n💖', 29000, 12, 'N', 'Y', '남녀공용 내추럴 잠옷 긴 바지', 33000, 99, 30, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (168, '2025-03-07 22:15:39', '2025-03-18 22:28:28', 'Y', 'Y', '4940510752', b'0', '라타탐의 인기 아이템 \'호박 바지\'가\n여름 버전으로 돌아왔습니다!\n봉긋한 핏의 호박 라인에\n넉넉한 사이즈로\n남녀노소 편하게 입을 수 있는 고무줄 바지예요.\n작년 겨울 버전을 구매하셨던 분들께서\n남편분이나 남자 형제들이 탐내하신다는 후기를 많이 받았습니다.\n그만큼 널널하고 편하다는 이야기겠지요!\n\n그 래 서 !\n모두가 함께 입을 수 있는 패턴과 색감으로 제작했습니다.\n즐거운 바다가 느껴지는 패턴들도 제작했어요.\n얼마 전 이른 휴가 때,\n섬에서 스노쿨링하며 물고기들을 관찰하고\n해변에 누워 바람을 느꼈던 일이 정말 행복했어요.\n그 기억을 담아 만들었답니다.\n100% 국내산 면 소재로 튼튼하고 퀄리티가 좋아요.', 54000, 0, 'N', 'Y', '라타탐 피쉬 인 더 카우치 호박 바지, 2 colors', 54000, 99, 30, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (167, '2025-03-07 22:15:38', '2025-03-18 22:28:28', 'Y', 'Y', '9150753529', b'0', '명상복 티셔츠를 만든 원단을 활용해\n세트로 착용할만한 바지를 같이 작업했어요~\n\n코튼 100%로 땀흡수도 좋고 통기성도 좋아 친환경 섬유로 피부가 좋아하는 원단이죠 ㅎ\n\n그외 원단의 장점과 특징은\n같이 세트로 입을수 있는 명상복 티셔츠에서 자세히 올려 놓았으니 참고해 주세요 ^^\n\n일단\n일상 생활복이고 명상복이다 보니\n상의처럼 편안한 착용에\n가장 중점을 두고 작업했어요~\n\n허리를 전체 밴딩으로\n편안한 착용이 가능하구요\n\n벤딩이어도 너무 조여서\n불편한 경험들 있으실텐데\n넉넉하게 벤딩처리해\n신경쓰이지 않도록 했어요ㅎ\n\n엉덩이 밑위 길이도 일반옷들보다는\n조금 더 여유를 두어\n활동하시는데 무리없이 편안하답니다\n\n또한\n면소재의 단점인\n앉았을때 무릎이 나오지 않을만큼 다리폭도 여유를 두었어요👍👍\n\n그러면서도\n허리부분 여유분을 많이 주지 않아\n일상 외출복으로도 충분히 가능하도록 너무 펑퍼짐은 아니예요 ㅎ\n\n통바지로 처라해\n요즘 유행스탈로\n일반적인 생활한복바지와\n차별화를 두어서\n일상속에서도\n편안하게 착용할수 있을것 같아요\n\n저에겐 이미 일상복이죠 ~^^', 39600, 9, 'N', 'Y', '생활한복 바지 명상복 절복 개량 코튼', 44000, 99, 30, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (166, '2025-03-07 22:15:36', '2025-03-18 22:28:28', 'Y', 'Y', '0464831271', b'0', '앞지퍼(뒷고무줄) 오버핏 스판 핀턱바지\n***** 첫 팔로우 쿠폰5000 *****\n***** 착한 리뷰 쿠폰 5000 *****\n드립니다.\n\n* 15마리 토끼를 잡은 fw(가을.겨울)시즌 바지(여름을 제외한 모든 계절 가능)\n\n* 원단의 바다에서 헤매고 찾은 보석같은 원단으로 만들었습니다.!\n\n* 색상별 빠른 품절 예상됩니다.\n\n* 원하는 칼라로 겟하시려면 서두르세요\n\n<15마리, 다 잡았습니다.>\n보온성/ 통기성/ 가벼움/ 깔끔한 재봉/ 오피스룩/ 평상복/ 여행복/ 천연원단/ 내 피부같은촉감/ 가성비up up/ 스판으로편안함/ 날씬한 핏감/ 모든연령/남녀공용/ 멋스러운칼라\n\n* 데님은 특성상 워싱가공된 원단이라도 물빠짐이 있습니다.\n꼭! 꼭! 단독세탁!\n\n● MD 추천노트\n- 어디든 편하게 입고 나설 옷은 찾으시나요?\n캐주얼하고 활동적이지만,\n- 언제, 어디서 입어도 품위 있고 멋스러워 보이는 바지입니다.\n- 장시간 운전을 해도 편안하고, 장거리 여행을 해도 편안합니다.\n- 워싱과 가공을 거친 천연섬유라 더욱 더욱 느낌이 좋습니다.\n- 어느 색상과 코디해도 어울리는 기본 색상만 골랐습니다.\n카키! 카멜! 차콜(품절)', 79000, 18, 'N', 'Y', '앞지퍼(뒷고무줄) 오버핏 스판 핀턱바지', 97000, 99, 30, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (165, '2025-03-07 22:15:36', '2025-03-18 22:28:28', 'Y', 'Y', '4478407509', b'0', '잡사, 올트임, 작은 오염으로\n분류된 상품을 B급 할인합니다.(노마진)\n기능과 디자인은 동일합니다.\n\nB급이 나올때마다 선별하여 올리기때문에\n소량씩 나오고, 그때그때 재고가 다릅니다.\n\n\n\n편안한 니트 바지 소개해드립니다.\n\n-------------------------------------------------------------------\n\n제가 입으려고 만들었다가 지인들에게 인기가 폭주해서\n색상별로 만들게되고 인기가 많아져\n4년째 꾸준히 판매하고 있는 제품입니다.\n\n보통 고무줄 바지를 입고\n중요한 자리를 나가기 좀 꺼려지는데\n이건 정장 바지처럼 고급지고 또 톡톡해서\n출근길이나, 약속 나가실 때\n아주 인기가 많아요.\n\n제가 몸소 피팅을 여러번하며 패턴을 수정해서\nY존 부각도 안되고\n허벅지도 안붙고\n엉덩이 라인도 티가 안나는\n그야말로 저의 "꿈의 바지"입니다^^', 18000, 49, 'N', 'Y', '[B급할인]니트 와이드 팬츠', 35900, 99, 30, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (164, '2025-03-07 22:15:35', '2025-03-18 22:28:28', 'Y', 'Y', '4583308328', b'0', '스트릿 바이브 디자인 커스텀 티셔츠!\n\n티셔츠는 프린트스타 제품으로 세계적으로\n프린팅 티셔츠에 가장 많이 사용되는 제품이며\n테리(쭈리) 원단으로 세탁후 변형이나 뒤틀림도\n적은 장점이 있습니다^^\n\n🎁주문방법🎁\n\n1. 티셔츠 색상과 사이즈, 프린트 위치 등 옵션을 선택해주세요.\n\n2. 옵션 선택을 완료하셨다면 주문후 입금완료를 해주세요.\n﻿\n3. 작가에게 원하시는 내용 및 닉네임을 보내주세요.\n(닉네임으로 변경 가능한 커스텀 티셔츠 입니다. 7글자 이하 가능)\n※샘플 이미지 참고\n\n제작과 배송은 기본 7일정도 걸립니다. 여유있게 주문해주세요 :)\n(공휴일을 제외한 제작기간 입니다.)\n\n\n🔊주문 전 꼭 읽어주세요🔊\n※핸드메이드 특성상 화면에 보이는 색상과 크기가 조금씩 다를 수 있습니다\n\n※기재된 가격은 옷 한 벌의 가격입니다.\n\n※인쇄 사이즈\n왼쪽마크: 6cm이내 / 뒷면 30cm이내', 30900, 24, 'N', 'Y', '[커스텀]스트릿 바이브 디자인 티셔츠 맨투맨, 후드티', 40900, 99, 29, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (163, '2025-03-07 22:15:35', '2025-03-18 22:28:28', 'Y', 'Y', '9691838790', b'0', '[기재된 가격은 옷 한 벌의 가격입니다.]\n\n❤️스페인어로\n\nenamorados\n사랑하는이란 뜻이며,\n\nLOS QUE PASO COTIGO\n함께 하는 것들 (시간들)\n\n이라는 뜻입니다:)\n\n우리만의 특별한 기념일로 특별한 선물 해보세요:)\n❤️특별한 날 색다른 선물을 하고싶다면,\n추천드려요❤️\n\n커플티, 또는 내가 기억하고 싶은\n기념일을 넣어보세요:)\n\n과하지 않은 디자인이라서 편하게 언제든\n입을 수 있게 디자인했어요!\n\n\n[MODEL INFO]\n여-166CM, S 사이즈 착용\n남-180CM, XL 사이즈 착용\n\n🎈🎈🎈🎈\n17수는 다른 티셔츠보다 기장이\n약간 길게 나왔어요. 참고부탁드립니다!\n\n***32수는 정사이즈 입니다:)🎈🎈🎈🎈\n\n\n[fabric]\n면 100%\n두께 17(보통) / 비침(화이트 약간 있음)\n두께 32(얇음) / 비침 있음\n\n--------------\n\n❤️티셔츠 색상과 사이즈를 선택 후\n원하는 기념일은 년 월 일 순으로\n요청사항에 작성해주세요❤️', 9900, 44, 'N', 'Y', '빠른배송🎈 로고형 기념일 졸업선물 커플 반팔티셔츠', 18000, 99, 29, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (162, '2025-03-07 22:15:34', '2025-03-18 22:28:28', 'Y', 'Y', '1557957970', b'0', '💝 특별한 날에 커플티, 가족티, 결혼 선물, 돌잔치 선물\n또는 나만의 티셔츠를 제작해 보세요^^💝\n\n커플, 가족, 반려동물 혹은 소중한 물건도 사진으로 보내주시면 예쁘게 그려서\n티셔츠, 쿠션, 에코백 등 패브릭 제품에 정성스럽게 인쇄 해드려요~\n\n\n🎁주문방법🎁\n\n1. 티셔츠 종류와 색상, 사이즈, 드로잉, 인원수 옵션을 선택해주세요.\n\n2. 옵션 선택을 완료하셨다면 주문후 입금완료를 해주세요.\n(요청사항에 문구를 적어주셔도 됩니다.)\n\n3. 작가에게 메시지로 제작하실 사진과 원하시는 문구를 함께 보내주세요.\n(문구는 한글과 영어 모두 3+3자로 맞춰주시는게 가장 예뻐요.😁)\n\n4. 시안을 확인하신 뒤 확정을 해주시면 바로 제작에 들어갑니다.\n\n※시안 수정은 1회 가능하니 참고 부탁드립니다.😁\n\n🔊주문 전 꼭 읽어주세요🔊\n※핸드메이드 특성상 화면에 보이는 색상과 크기가 조금씩 다를 수 있습니다\n\n※주문제작 상품으로 1차 그래픽시안이 진행된 작업은 전액 환불이 불가능합니다.\n(1차 그래픽 시안비 1만5천원을 제외한 나머지 금액 환불)\n\n※티셔츠 제작후 프린트하는 공정이라 주문12시간 이후에\n티셔츠 색상,사이즈 변경이 어려운점 참고해주세요.\n\n※기재된 가격은 옷 한 벌의 가격입니다.\n커플티 한 세트에 시안은 1개 입니다\n\n※ 인물은 1~2인 기준입니다.\n반려동물, 복잡한 물품(꽃다발,자전거,자동차 등)도 인원수에 포함됩니다. [배경이나 자연(산,바다,나무 등),옷(털)무늬 드로잉 불가]\n\n\n※ 의상은 일상복 기준입니다.\n행사복(드레스, 한복, 할로윈, 코스튬 의상 등)은 추가금이 있습니다.\n\n※ 눈코입 없는 라인 드로잉 기준이며\n인쇄 사이즈는 10cm x 10cm 이내 입니다.\n\n※작업파일은 작가 포트폴리오로 사용될 수 있습니다.\n원치 않으시면 요청사항에 미리 말씀해 주세요~💜', 20900, 25, 'N', 'Y', '[빠른배송 커스텀 티셔츠]드로잉 반팔티 주문 제작', 28000, 99, 29, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (161, '2025-03-07 22:15:33', '2025-03-18 22:28:28', 'Y', 'Y', '8137349465', b'0', '♦️ 커스텀 의류 끝판 왕♦️\n\n단언컨데 드로잉은 자수가 이쁩니다!\n\n특별하게 실색상도 선택가능!\n\n💑커플티,신혼선물,집들이 선물!\n👨‍👩‍👧‍👦 가족티로도 딱이야!\n아동용사이즈도 준비되어있습니다 : )\n\n*주문제작 상품으로 배송에 여유를 두고 주문부탁드려요*\n\n\n😊히트메이드 3가지 약속😊\n\n하나 " 최고급 옷 사용\n\n살짝 도톰하고 비침이 없는 KC인증된\n코마사 100% 원단\n베이직 (basic) 디자인으로 남녀공용\n누구나 잘 어울리는 핏입니다\n\n둘 " 프로페셔널 자수\n\n자수는 인쇄방식중 가장 고급스럽고\n어려운 표현입니다\n작가가 모든공정을 직접함으로써\n합리적 가격으로 최상의 옷을\n제공해 드립니다!\n\n셋 " 커스텀 의류제작\n\n세상에 고객님을 위한 단하나의\n옷을 만들어드립니다!', 26900, 0, 'N', 'Y', '커스텀드로잉자수커플라운드티[커플,가족,단체]', 26900, 99, 29, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (160, '2025-03-07 22:15:32', '2025-03-18 22:28:28', 'Y', 'Y', '2310685720', b'0', '📍리퍼브 특가📍\n\n(*리퍼브: 제작과정에서 생긴 약간 흠이 있거나 색상이\n제대로 나오지 않은 제품들입니다.)\n\n⚠️리퍼브 상품인 만큼 작품 정보들을\n꼼꼼히 확인해주신 후 주문 부탁드립니다 !!\n\n✔️체크사항 1\n\nA타입\n- 시보리 원단이 몸판에비해 좀더 진하게 나온 상품입니다\n일반적으로 시보리를 몸판에비해 진하게 사용하지만 ,\n처음 상품과 달라 판매하지 못한 상품입니다\n그 외 프린트를 포함한 전체적인\n퀄리티는 세상품과 동일합니다.\n\nB타입\n- 뒷판 옆구리 쪽에 원단색상이 빠진 상품입니다\nA타입 확인후 급하게 기존 원단에 비해 2배 비싼 원단으로 주문했는데 ,\n이것마저 출고 과정에서 발견되어 판매하지 못한 작품이랍니다😢\n그 외 프린트를 포함한 전체적인\n퀄리티는 세상품과 동일합니다.\n\n\n✔️체크사항 2\n-리퍼브 이벤트 상품에한해서만 교환 및 환불이\n불가합니다.\n\n* 모든 상품은 무료배송 입니다!', 12900, 66, 'N', 'Y', '[리퍼브 특가] CROP DOODLE SKY BLUE', 38000, 99, 29, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (159, '2025-03-07 22:15:31', '2025-03-18 22:28:28', 'Y', 'Y', '9959909643', b'0', 'ORIGINAL DAY 구매 혜택👍\n\n📌 혜택01. 오리지널데이 팔로우 하고 10% 할인 쿠폰 받기\n📌 혜택02. 후기 약속하고 1,000원 즉시 할인\n📌 혜택03. 구매후 텍스트 후기 작성시 500P 적립금 지급\n📌 혜택04. 구매후 포토 후기 작성시 1,000P 적립금 지급\n\n※ 적립금은 구매 후 후기를 등록한 시점에 아이디어스 적립금이 지급됩니다.\n후기 수정을 통해 사진을 등록한 경우에는 적립금이 추가 지급되지 않습니다.\n텍스트 후기와 사진 후기 포인트는 중복 지급되지 않습니다.\n\n내 몸에 딱 맞는\n자체 제작 브랜드 ✨ORIGINAL DAY✨\n\n언제 어디서나 편하게 입을 수 있고\n창의적이고 독보적인 디자인을 선보이는 브랜드로\n모든 날을 특별하게 만들어주는 의류를 제공합니다.\n오직 오리지널데이 에서만 만나볼 수 있는\n특별한 제품들을 통해 소비자들은 자신만의 스타일을\n표현하며 매일을 특별하게 보낼 수 있습니다😘\n\n"오리지널데이를" 방문해주셔서 진심으로 감사드리며\n즐거운 쇼핑 되시길 바라겠습니다😆', 26900, 41, 'N', 'Y', '✨국뽕 선물✨ 곤룡포 반팔 티셔츠🐲', 46000, 99, 29, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (158, '2025-03-07 22:15:31', '2025-03-18 22:28:28', 'Y', 'Y', '8090483192', b'0', '😚\n불스아이의 인기템!\n뒷모습이 매력적인 힙하고 멋진 디자인으로\n인기있는 작품입니다.\n\n🤩🤩🤩\n"허스키 가족"이라는 타이틀로\n멋있는 간지동물 허스키를 그렸어요\n평소에 허스키를 좋아하는 작가로서 허스키의 시크하면서 강인한 모습을 표현하고 싶었어요.\n먼저 든든해보이는, 가장으로서 강인한 모습의 허스키를 중심으로 끈끈하게 이어져 있는 가족을 그린 그림입니다. 그래서 허스키 가족이라고 이름을 붙였어요.\n작가의 감성을 담아 그려진 그림을 실크스크린 기법을 이용해 블랙과 화이트 티셔츠에 찍어냈어요.💛\n\n칼라는 두가지로 화이트에는 블랙으로 블랙에는 화이트 칼라로 이미지를 담았습니다!\n\n🔥실크스크린을 이용한 프린팅 기법으로\n찍을 때 마다 각각 다른 매력의 느낌을 표현합니다.\n이것이 바로 핸드메이드 매력이죠!\n찍을때마다 달라보이는 느낌을 연출합니다.\n\n♦️티셔츠 소재\n면100% 17수 코마사 원단으로 목부분 방지탭으로 이중 마감처리 되어 있어 프리미엄급 디테일이 있는 티셔츠입니다.\n비침이 적고 두께는 보통인 편입니다\n국내에서 생산하는 원단입니다.\n\n♦️사이즈\n\n<인기작품으로 사이즈를 조금 더 추가했습니다>\n남녀 프리사이즈가 준비되어있어서\n커플룩으로도 아주 좋을 거같아요!\n\n여자 프리 사이즈는 90/ 95 사이즈 정도이구요\n남자 프리 사이즈는 100- 105 / 110~115 사이즈\n정도라고 생각하면 됩니다.\n총장 체크하시면 선택하기 쉬우실 거에요!\n남녀노소 멋지게 입을 수 있어요!\n\n•FREE SIZE (남녀공용)\n\n옵션1.여자FREE:\n총기장 66/가슴넓이 49/어깨 44/소매 19\n\n옵션2. 여자 BIG FREE:\n총기장 70/ 가슴넓이 52/ 어깨 47/소매 20\n\n옵션3.남자FREE:\n총기장 74 / 가슴넓이 55 / 어깨 50/ 소매 22\n\n옵션4. 남자 BIG FREE:\n총기장 78/ 가슴넓이 58/ 어깨 53/ 소매 24\n\n👍더 큰 사이즈 원하시면 메세지 보내주세요 !\n(사이즈 측정에 따라 1-3cm 오차가 있을 수 있습니다.)\n\n♠️\n모델키는 158cm에 44사이즈이고\n모델이 착용한 티셔츠 사이즈\n/화이트 티셔츠 : 남자FREE\n/블랙 티셔츠 : 여자FREE\n♠️\n\n\n🔻세탁시 유의사항은 [작품 정보제공 고시]에서\n꼭 확인해주세요!\n<건조기 ❌ 드라이 ❌ >', 44000, 0, 'N', 'Y', '블랙 앤 화이트 🔥허스키 반팔티셔츠', 44000, 99, 29, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (157, '2025-03-07 22:15:30', '2025-03-18 22:28:28', 'Y', 'Y', '1623874240', b'0', '티셔츠 제작 주의사항\n1. 글씨 줄바꿈을 원하실 경우 슬래시(/표시)적어주세요.\n2.넣으실 글자가 너무 길 경우 크기를 임의로 줄여서 넣어드립니다.\n따로 협의가 없이 제작될경우 교환, 환불은 불가합니다\n(원하시는 요청사항이 있으실경우 주문후 아이디어스 메세지로 연락 주세요)\n3.유색티 제작시에는 검은색,흰색중 잘 보이는 색으로 인쇄 됩니다.\n4.주문후 아이디어스 메세지로 원하시는 문구를 보내주세요\n예시) XL 화이트 JEJU\nS 연핑크 SON\n이런식으로 메세지 보내주시면 시안 보내드린뒤 제작하겠습니다.', 6500, 56, 'N', 'Y', '아이러브 티셔츠 주문 제작 단체 가족 여행 반티 무지', 15000, 99, 29, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (156, '2025-03-07 22:15:29', '2025-03-18 22:28:28', 'Y', 'Y', '1967039789', b'0', '수년간 수만장을 제작한 티셔츠 프린팅 노하우와\n시중에 판매중인 프린팅 티셔츠와 같은 퀄리티로 인정받은,\n소품 커스텀 티셔츠 입니다.\n모든 주문 제작은 의류에 직접 프린팅하는 DTG 방식인\n고급 디지털 프린팅으로 진행합니다.\n【 ①티셔츠 고르기 】\n프린트스타 반팔 티셔츠\n190g(5.6oz) 17수 헤비웨잇 티셔츠\n\nㆍ컬러\n화이트, 그레이, 블랙, 라이트 블루, 핑크, 핫핑크, 데이지(노랑), 그린, 터쿼이즈, 로얄블루, 버건디, 올리브, 네이비, 레드, 퍼플, 오렌지, 민트, 에쉬, 아이보리, 라임, 라이트 핑크, 라이트 퍼플\n\nㆍ사이즈\nS, M, L, XL, 2XL\n\nㆍ많이 입는 사이즈\n163cm - S / 기장:66cm / 몸통폭:49cm\n170cm - M / 기장:70cm / 몸통폭:52cm\n179cm - L / 기장:74cm / 몸통폭:55cm\n181cm - XL / 기장:78cm / 몸통폭:58cm\n183cm - 2XL / 기장:82cm / 몸통폭:61cm\n\n【 ② 티셔츠를 고르신 후 직접 디자인한 이미지 파일 또는 사진을 보내주세요! 】\n일반 사진 프린팅 - jpg, psd\n디자인 로고 파일 - ai, psd, png\n프린팅 최대사이즈 - 30x30cm\n\n【 ③ 이미지 파일이 준비가 되셨다면 이메일 ( dtgcustom@gmail.com )로 보내주세요! 】\n＞아이디어스 주문\n＞이름:\n＞연락처:\n＞프린팅 위치 및 크기: 예) 티셔츠 앞면 가로 cm\n＞첨부파일', 19000, 0, 'N', 'Y', '🎁내맘대로 커스텀 티셔츠🎁 수입반팔티에 고퀄프린팅', 19000, 99, 29, 4);
