INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (154, '2025-03-07 22:15:28', '2025-03-18 22:28:28', 'Y', 'Y', '0681783749', b'0', '자수양면피치기모 🎁커플가족잠옷🎁 체크베어\n✨자수 양면피치기모 가족잠옷 ✨\n\n❤POINT❤\n저희 2WE의 양면피치기모 제품으로 피치기모가 양면으로 들어가\n더욱 도톰해진 양면피치기모, 포인트로 자수가 들어간!! 가족잠옷제품을 소개해드리겠습니다.\n\n👉제품 소재는 폴리에스테르 90% 폴리우레탄 10%\n프리미엄 피치양면기모입니다.\n\n👉피치기모란 복숭아 표면처럼 얇은 기모를 생성한 원단으로\n착용감이 편해 미세한 움직임 및 수면에도 안 입은듯 한\n느낌을 선사합니다.\n\n👉또한 기모 사이에 공기층이 형성되어 있어 열을 품을 수 있도록 하여\n더욱 따뜻하게 체온을 유지시켜 줍니다!\n\n👉 원단에 의한 마찰과 정전기를 줄이고 알러지 방지 및 아기피부에\n자극을 주지 않게 개발하여 안전성까지 인증(KC)이 완료된 제품입니다!\n\n❤사이즈❤\n\n남성은 Free사이즈와 XL사이즈,\n여성은 Free사이즈,\n아동은 S, M, L, XL사이즈가 준비되어있습니다:)\n\n저희 2WE와 올겨울 행복하고 따뜻하게 보내세요 🎉', 20900, 19, 'N', 'Y', '자수 양면피치기모🎁커플가족잠옷🎁체크베어', 25900, 99, 28, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (153, '2025-03-07 22:15:27', '2025-03-18 22:28:28', 'Y', 'Y', '9212658570', b'0', 'FAIRYTALE PANTS_동화 팬츠\n\n🤜오궁이/하비 추천!🤛\n\n귀여운 곰돌이가 나오는 동화같은 프린팅이 돋보이는 바지입니다! 편하게 입기 좋은 밑위가 긴~~~ 홈웨어입니다👍\n\n아뜰리에의 작품 중 "데이지 롱팬츠" 그 작품과 같은 패턴입니다!\n\n7번의 샘플링 끝에 완성되었습니다!\n하비/오궁이분들 이거 꼭 장만하세요!\n엉덩이둘레, 허벅지둘레 엄청 넉넉하게 만들어서 완전 편해요!\n(아래로 갈수록 살짝 좁아짐.)\n밑위도 아주 넉넉하게 제작해서 배바지 가능!\n(44~88까지 가능/더 큰사이즈는 메세지 주세요❗️)\n📍패턴자체는 변화없고 허리둘레로 사이즈 나뉩니다!\n숙지해주세요!\n\n어중간하게 짧지 않고 발목 아래까지 오도록 제작했습니다!\n📍키작녀 기준. 키 크신분들은 기장 문의 주세요!\n\n커다란 주머니도 양쪽으로 만들어줘서 실용성도 좋아요👍\n개인적으로 바지에는 크고 깊은 주머니가 필수라 생각합니닷‼️\n집에서만 입더라도 주머니가 필요할때가 많더라구요!\n크고, 깊어 휴대폰 정도는 거뜬히 들어갑니다~\n손목이 들어갈 정도로 깊어 물건이 주머니에서 빠지는 일도 없어요!\n\n네이비, 레드 두가지 컬러로 커플끼리 혹은 친구끼리, 남매끼리 나눠 입기 너무 좋아요!\n선물용으로도 좋아용🎁\n\n* 재단 위치에 따라 색감&무늬 배열이 달라질 수 있습니다.\n* 모니터나 폰에 따라 색상 차이가 있을 수 있습니다\n---------------------------\n주문시 제작에 들어가는 제품으로 주말 제외 1~2주 정도 소요됩니다.\n최대한 빠르게 받아보실 수 있도록 제작하여 배송해드리겠습니다.', 36800, 0, 'N', 'Y', '[커플/오궁/하비]Fairytale Pants(곰돌이)', 36800, 99, 28, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (152, '2025-03-07 22:15:26', '2025-03-18 22:28:28', 'Y', 'Y', '3741875547', b'0', '카치온기모 ?여성와이드팬츠?\n✨카치온 기모 여성와이드팬츠✨\n\n❤POINT❤\n저희 2WE의 카치온이라는 신소재제품으로\n추위에 끄떡없고 내구성도 좋은! 카치온 기모 여성 와이드팬츠를 소개해드리겠습니다.\n\n?제품 소재는 폴리에스테르 60%/ 카치온 30%/ 폴리우레탄 10%입니다.\n\n?카치온이란 고급 소재인 카치온사를 혼방한 양면 기모 원단으로 일반 폴리보다\n내구성이 강해 늘어짐과 구김이 덜하고 보온성이 매우 좋아 착용시 더 부드럽고 따뜻합니다.\n\n?실내에서는 따뜻하고 편한 바지! 실외에서는 꾸안꾸패션바지로!\n언제 어디서든 편하게 착용하실 수 있는 카치온 기모 여성 와이드팬츠!!\n\n❤사이즈❤\n사이즈는 FREE, L가 준비되어있습니다.\n색상은 네이비, 차콜, 블랙이 준비되어있습니다:)\n\n저희 2WE와 올겨울 행복하고 따뜻하게 보내세요 ?', 12900, 18, 'N', 'Y', '투위 카치온 기모 🎁여성와이드팬츠🎁 3COLOR', 15900, 99, 28, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (151, '2025-03-07 22:15:26', '2025-03-18 22:28:28', 'Y', 'Y', '9703004405', b'0', '❤️주문방법 ❤️ 이니셜 문구 자수각인을기본으로 설정되어있습니다. 1. 이니셜 or 문구 자수각인 안내 -메시지 (작품문의)를 통하여 하트의 경우 한글로 적어주세요 (예 : JAR 하트 MIH) 2. 글씨체와 실색상 상단에 올려진 사진 참고부탁드립니다. 3. 옵션추가/사진스케치 드로잉자수 각인 안내 사진스케치 자수각인을 원하는 경우 메시지(작가문의)를 통해 사진을 보내 주세요. -사진은 많이 보내주셔야 좋아요 -상반신을 기본으로 작업합니다. 전신을 원하는 경우 깔끔한 결과물이 나오지 않을 수 있으니 필요한 경우 문의 주세요. -사람 수는 1-2인 기준으로 3인 이상의 인물, 동물 등은 추가요금이 발생합니다. -단순하고 심플한 자수를 위해 배경과 이목구비는 없이 작업합니다. -상의 포켓 윗부분이 기본 자수 위치 입니다. 👉🏻유의사항 작품은 SNS나 광고 등에 업로드 될 수 있습니다. 원하지 않는 경우 미리 알려주세요.', 44000, 0, 'N', 'Y', '반팔 반바지 드로잉 이니셜 커스텀 각인 잠옷', 44000, 99, 28, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (150, '2025-03-07 22:15:25', '2025-03-18 22:28:28', 'Y', 'Y', '0302459665', b'0', '몸의 편안함은 마음의 편안함으로 연결됩니다. 편안한 루즈핏과 숨쉬는 면 소재로 제작된 플로럴 파자마세트를 소개드려요. 피부가 먼저 느끼는 편안함을 만끽해보세요. 핸드블럭프린트 원단으로 인도 장인들의 섬세한 손길로 100% 핸드메이드로 완성되었어요. 쌀쌀해진 날씨, 플로럴 파자마세트와 함께 일상의 풍요로움을 더해보세요.** feature **\n\n- 셔츠형 상의 디자인과 루즈핏 하의 디자인으로 편안한 파자마웨어입니다.\n- 하의 끈으로 허리를 편안하게 조절해 줄 수 있어요.\n- 디지털 패턴에서 느낄 수 없는\n핸드블록프린트의 서정적 느낌을 담아냈어요.\n- 핸드블록프린트는 유해한 화학성분이 없이 (Azo-free)\n자연의 소재로 염색해낸 기법으로 지속가능성에 집중했습니다.\n- 사용된 단추마저도 자개 단추로 자연의 소재를 사용했어요.', 88000, 19, 'N', 'Y', '하와이블루 플로럴 파자마세트 핸드블록프린트 핸드메이드', 109000, 99, 28, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (149, '2025-03-07 22:15:24', '2025-03-18 22:28:28', 'Y', 'Y', '5063594525', b'0', '프리찌는 불편한 캡이나 패드 없이 노브라로 입는 여성 웨어에요.\n쫀쫀한 밴딩이 가슴을 안정감 있게 잡아주면서\n앞의 레이스가 BP를 가려줍니다.\n프리찌만의 유일무이한 기능과 디자인이에요!\n📌\n\n블랙 / 연베이지 & 연핑크 & 그레이\n이렇게 두가지가 소매 기장, 총기장이 미세하게 달라요!\n블랙은 소매 기장이 조금 더 길고, 총기장도 나머지 3컬러보다 5센치 깁니다!\n(블랙 총기장은 120cm 입니다.)\n\n❌그레이 F 품절❌\n\n모든 컬러에 주머니는 다 있습니다!\n원피스에 주머니 있으면 엄청 편한거 아시죠?!', 75000, 0, 'N', 'Y', '[베스트] 노브라로 입는 홈드레스 프리찌 S/S 시즌', 75000, 99, 28, 4);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (148, '2025-03-07 22:15:23', '2025-03-18 22:28:28', 'Y', 'Y', '1282684981', b'0', '제작기간 2-10일 소요되니, 여유롭게 주문 부탁드립니다☺️\n\n모든 제품은 원단 선택부터 제작까지\n모두 금잔디만의 노하우로 만들었습니다.\n\n?\n상의/하의 각각 판매합니다.\n세트로 주문시 옵션에서 하의추가 해주세요:)\n\n세탁시 주의할 점은 특별히 없습니다.\n오염시 삶아서 햇볕에 널어두면\n하얗게 깨끗해집니다.\n\n\n✔️55-66사이즈\n[상의]\n총장(어깨-밑단) 65cm\n가슴단면 59cm\n소매길이 44cm\n소매단면 19cm\n어깨 38cm\n[하의]\n총장 83cm\n허리단면 32cm (고무줄)\n밑단단면 19cm (고무줄)\n허벅지단면 31cm\n\n✔️77-88사이즈\n[상의]\n총장(어깨-밑단) 65cm\n가슴단면 62cm\n소매길이 44cm\n어깨 40cm\n[하의]\n총장 83cm\n허리단면 38cm (고무줄)\n밑단단면 19cm (고무줄)\n허벅지단면 35cm\n\n*1-2cm의 오차가 있을 수 있습니다.*\n\n모델 키 160cm\n\n<원단>\n30수 광목', 63000, 0, 'N', 'Y', '포근 잠옷 세트', 63000, 99, 28, 4);
