INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (145, '2025-03-07 22:15:21', '2025-03-07 22:20:10', 'Y', 'N', '5231168349', b'0', '❤️ 팔로우 하시고 할인받으세요 ❤️\n\n🌟잠옷은 상하의로 이니셜이 포함된 한벌 가격 입니다🌟\n\n모던한 체크 디자인에\n원하는 사진을 드로잉 스케치하여\n세상에 단 하나뿐인 잠옷을 만들어보세요💕\n\n👉🏻소재\n소재는 면 100%\n약간의 기모처리가 되어있어\n부드럽고, 촉감이좋아요.\n\n👉🏻디테일 부분 !\n남성용 과 여성용은\n단추사이즈가 다르고, 여성용은 단추가 왼쪽,\n남성용은 오른쪽에 있어요👐\n남성용 하의의 경우 앞쪽에 시크릿 단추가 달려있어요.\n\n👉🏻사이즈\n(상단 사이즈표 사진 참고)\n작가문의로 성별,키,몸무게 알려주셔도 사이즈 추천드려요^^', 47000, 0, 'N', 'N', '순면 잠옷 이니셜 드로잉 각인 신혼부부 집들이 선물', 47000, 99, 28, 4);
