INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (105, '2025-03-07 22:14:35', '2025-03-07 22:20:10', 'Y', 'N', '6476059304', b'0', '주문증가로 배송기간 7-10일(공휴일 제외) 입니다\n북커버 안감은\n원단 공급 사정에 따라 종종 바뀔수도 있어요.\n메시지 드리겠습니다!\n\n옆 코코나 한글라벨은\n내부 안감 라벨로 대체됩니다.\n\n\n📢 사이즈 맞춤 채팅 상담 하신분들은\n꼭!!!! 주문메모에 다시 한번 남겨주세요.!\n작업시 채팅상담 확인 힘듭니다.', 31000, 0, 'N', 'N', '코코나 토끼 아이패드, 노트북파우치', 31000, 99, 3, 3);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (104, '2025-03-07 22:14:34', '2025-03-07 22:20:10', 'Y', 'N', '5571961418', b'0', '🛁 안내 사항\n\n🤍작품 준비중 상태로 변경된 이후에는 옵션 변경이나 취소가 불가능합니다 주문 전 한번 더 확인 부탁드립니다\n\n🤍 기종 선택 목록에 찾으시는 기종이 없다면 그 외 기종 선택 후 요청사항에 기종명을 남겨주시면 됩니다!\n\n🤍제작기간은 1~7일이며 제작 완료 당일이나 다음날 바로 발송됩니다 (그 외 기종의 경우 개별적으로 주문해야 하므로 기존 기간보다 1-2일 정도 더 걸릴 수 있습니다)\n\n🤍범퍼가 없는 케이스 디자인이 기본이며, 플립 및 그 외 기종의 경우 범퍼 유무가 랜덤으로 작업되며 선택이 불가능합니다\n\n🤍 플립 기종의 경우 대칭 배치가 기본입니다\n플립 1-4 기종은 가운데 비워주세요 선택시 아랫면의 상단 부분을 비워드려요! (대칭배치를 원하시지 않거나 윗면에 비움을 원하시는 경우 요청사항에 남겨주세요)\n\n🤍 알콜스왑 사용시 표면이 상하고 광택이 사라질 수 있어요 부드러운 천으로 닦아주세요:)', 23400, 19, 'N', 'N', '🛁FLUFFY BATH CASE', 29000, 99, 3, 3);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (103, '2025-03-07 22:14:33', '2025-03-07 22:20:10', 'Y', 'N', '9412261795', b'0', '<S25 케이스 출시 공지>\n<S25 케이스 출시 공지>\n갤럭시 s25 케이스가 출시되었습니다\n현재 예약구매 형태로 제작이 들어가며, 주중(~2/6)이내에 출고 될 예정입니다.\nex)\n아이폰 15 - 여보세용\n갤럭시 s25 - 네 여봅니당\n\n위와 같이 주문해주신 경우 s25 발송일에 합포장되어 발송되오니 주문시 참고 부탁드립니다.\n항상 찾아주셔서 감사합니다.\n\n새해 복 많이 받으세요!\n첫 작가 팔로우는 할인쿠폰 지급!!!❤️', 13090, 15, 'N', 'N', '곰돌찡 토끼찡 커플 젤리 폰케이스 4종/ s25', 15400, 99, 3, 3);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (102, '2025-03-07 22:14:32', '2025-03-07 22:20:10', 'Y', 'N', '1142097463', b'0', 'ｐｒｅｃｉｏｕｓ ｇｉｆｔ\n\n\n하나뿐인 선물, 소중한 날,\n소중한 사람에게 정성을 담아드리세요\n\n\n🤍🩶🖤🤍🩶🖤\n\n\n•주말(토, 일요일)과 공휴일은 제작하지 않습니다!\n공장이 운영하질 않아요;_;\n\n•주말,공휴일 제외하고 약 일주일정도 소요됩니다\n\n•하트 인쇄 부분 말고는 미러(거울형)이지만\n깨지는 유리는 아니예요 ʕ·ᴥ·ʔ\n\n•작업 공정상 케이스에 오염(미세한 스크래치, 먼지, 점등)이\n있을 수 있습니다ᵒ̴̶̷̥́ ·̫ ᵒ̴̶̷̣̥̀ 미세한 경우 교환 혹은 반품이 어렵습니다\n검수 중에 오염이 제품은 미리 말씀드리고 교환 처리 후 배송합니다ᜊ\n\n•모니터 밝기, 해상도에 따라 색상 차이가 있으며 상세 이미지와 실제 상품의 색이 상이 할 수 있습니다⁂\n\n•젤리/젤하드 케이스의 UV 인쇄 기법 특성상 날카로운 곳에 긁히면\n벗겨짐이 발생하실 수 있습니다𖤐', 16000, 36, 'N', 'N', '🖤블랙 실버 하트 미러 범퍼 맥세이프 스마트톡🩶', 25000, 99, 3, 3);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (101, '2025-03-07 22:14:31', '2025-03-07 22:20:10', 'Y', 'N', '5540780340', b'0', '커플템, 생일선물, 기념일 선물, 반려동물 선물용으로 인기만점!🌷\n\n✔️총 8장의 사진이 들어갑니다\n(필요시 1-2장 추가로 요청드려요)\n\n✔️ 주문 및 결제 후\n기종과 사진 8장 메시지로 보내주세요!\n\n🌷 갤럭시 25시리즈\n투명젤리, 투명젤하드 현재 가능합니다! 🌷\n\n**투명젤리 제품은\n투명젤하드 제품보다 해상도가 훨씬 떨어질 수 있어\n투명젤하드 제품으로 추천드립니다**\n\n투명젤리 제품에 대한 인쇄 색상 및 화질에 대한\n교환 및 환불은 절대 불가하니 꼭 참고하셔서 구매부탁드립니다\n\n**폴드6,플립6 업데이트 완료!\n\n** 직접 작업해서 보내주시는 경우, 보내주신 도안 그대로\n저희는 인쇄만 진행해드리기 때문에\n도안으로 인한 인쇄불량 및 색감 차이는\n교환 및 환불 사유가 되지 않습니다.\n어플이나, 다른 프로그램 사용하셔서 보내주시는 경우가 많은데\n그럴 경우, 해상도가 깨지거나 원본과 색감이 달라지거나 할 수 있습니다.\n전문 포토샵이나 일러스트 프로그램으로\n패스작업하셔서 보내주시는걸\n적극 추천드리며,\n해당 작업이 어려우신 분들은\n저희 전문팀 작업을 맡기는걸 추천드립니다', 9000, 74, 'N', 'N', '얼굴 떼샷 폰 케이스 커스텀 주문제작 아기 얼굴 커플', 35000, 99, 3, 3);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (100, '2025-03-07 22:14:31', '2025-03-18 22:28:17', 'Y', 'Y', '4138430736', b'0', '‼️보다 나은 퀄리티를 위해 기존 젤리케이스에서\n젤하드케이스로 변경되었습니다!\n단가는 훨씬 올라가지만 좀 더 튼튼한 제품을 위해\n전면 업그레이드를 결정했어요!\n앞으로도 더 발전하는 미아르떼가 되겠습니당❤️‼️\n\n물감질감이 톡톡히 느껴지는 터치위에 도톰한 레진이 코팅되어 올라가는 케이스에요!\n물감이 벗겨질 걱정 없이 사용하실 수 있는 작업이랍니당🤍\n\n여러가지 색조합이 있으니 자유롭게 선택해주시고\n옵션에 없는 컬러조합는 상담예정 선택 후 작가문의 주시면 상담도와드릴게용\n전체적으로 펄감이 있는 물감과 믹스됩니다!\n원하지 않으시면 따로 말씀해주세용;)\n\n✔️세가지 컬러 선택 가능하시구 원하시는 위치와 색상 말씀해주시면 말씀해주신대로 제작 해드릴게용❤️\n\n\n옵션에 기종이 없으신 경우에도 문의 주시면 발주가능한지 확인한 후 주문도와드릴게요!!\n\n글리터 옵션은 레진코팅할 때 들어가는 반짝이로,\n옵션이 추가된 사진 참고해주시면 좋을것같아용🤍\n\n💙아래 사진들은 전부 글리터 있는 버전입니다!\n세트 상품 경우 선택 여부에 따라 케이스, 스마트톡 둘다 같은 옵션으로 들어갑니다!\n예) 글리터 있음-케이스, 스마트톡 둘다 글리터 추가됨💙', 25000, 0, 'N', 'N', 'S25가능 맥세이프 유화 질감 프레임 레진 폰케이스', 25000, 99, 3, 3);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (99, '2025-03-07 22:14:29', '2025-03-18 22:28:17', 'Y', 'Y', '1062871062', b'0', '저만의 감성을 폰케이스라는 작은 도화지에 그려내 폰케이스라는 기능성 제품을 더 이상 기능적인 측면만이 아닌 예술적 가치로 느껴질 수 있도록,  사람들의 일상 속에서 매순간 존재하는 폰케이스를 마주하는 순간마다 작은 행복을 드리고 싶다는 소망을 시케를 탄생시켰어요. 우리의 손과 가장 가까운 곳에서 만들 수 있는 여러분들 만의 특별한 무드를 그려 드리고 싶습니다.', 19500, 35, 'N', 'N', '[3일할인] ‘Coi’ 레진 물감폰케이스 색상 커스텀', 30000, 99, 3, 3);
