INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (94, '2025-03-07 22:14:24', '2025-03-18 22:28:17', 'Y', 'Y', '8446759867', b'0', '▪️오전11시부터 오후4시까지는\n포장&출고업무로 답변이 늦을 수 있습니다\n\n▪️택배박스에 상품명 안적혀있습니다. (대한통운)\n\n✔️제작에 필요한 문구는 주문요청사항에 기재해주세요\n\n✔️ 제작에 들어가면 변경 및 취소가 어렵습니다.\n\n✔️ 주소변경은 취소 후 재구매 해주세요.\n\n✔️ 재주문시 발송순서가 밀리는점 양해부탁드립니다.\n\n\n오래전부터 사랑받아왔던 디어메이드 상자편지가\n재정비하고 돌아왔어요-❤\n\n이니셜 두겹 제작\n알찬 구성 세트\n디어메이드 2단 상자편지 세트\n\n❗ 사진 20장 인쇄를 무료로 해드려요! (주문 직후 아이디어스 메세지로 사진 전송시)\n❗ 옵션선택시 이니셜 각인까지 해드려요!\n❗ 시중에 판매중인 용지 중 가장 질좋은 정품 양면 머메이드지를 사용해요\n❗ 이니셜 각인 후 두겹제작으로 튼튼함과 뚜렷함을 유지해요\n❗ 이니셜 없는 기본상자부터 이니셜 4면각인까지 원하는대로 선택이 가능하고 이니셜4면 선택시 할인이 주어져요\n❗ 이니셜 말씀 안해주실경우 하트로 제작됩니다\n❗ 2단으로 제작돼요\n❗ 꾸미기 구성품은 9개예요\n\n\n이니셜 선택시 주문메세지에 이니셜 내용 적어주세요! (5글자이내/영문,숫자,하트 가능,모두 대문자로 제작/,.같은 문자는 제외됩니다.)\n주문 후 바로 제작에 들어가는 맞춤제작 상품 특성상 교환 및 환불이 어려우니 신중한 구매 부탁해요\n송장 출력 이후에는 주소변경이 절대불가합니다.\n제작기간은 약 3-4일 소요되며 최대한 빠르게 받아보실 수 있게 항상 노력하고있어요\n상자편지는 제품특성상 다른제품과 묶음배송이 어려우세요. (딱맞는 상자에 완충포장을 위해)\n원활한 A/S를 위해 모든 포장과정은 cctv로 녹화됩니다.\n(택배박스 및 내용물이 없을경우 A/S가 불가할 수 있습니다)', 25028, 20, 'N', 'N', '상자편지세트 남자친구이벤트커플선물남친생일', 31500, 99, 21, 2);
