INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (91, '2025-03-07 22:14:21', '2025-03-18 22:28:17', 'Y', 'Y', '4697284368', b'0', '가족들, 지인들에게 기쁜 소식을 알려주세요🤍\n부모님, 시부모님께 임신 소식을 알리기에 딱이에요:)\n\n귀여운 엽서 디자인으로 한 번 심쿵,\n엽서를 열었을 때 아가 초음파사진 보고 정말 심쿵☺️\n\n🎀열었을 때 적히는 문구 변경 가능합니다🎀\n-글씨체는 감성체 / 귀여운체 중 선택-\n\n사진을 꽂을 수 있게 칼선이 있어서\n초음파사진을 넣기만 하면 끝이에요:)\n엽서를 담을 수 있는 편지봉투(컬러랜덤)도 함께 드려요.\n\n[배송 관련 주의사항]\n문구까지 모두 접수된 일자 기준\n+1 영업일 이내 발송됩니다.\n수령일자는 택배 상황에 따라 달라\n저희가 확정드리기 어려우며, 발송이 아닌\n배송으로 인한 교환 및 환불이 불가하니\n꼭! 날짜 여유있게 주문해주세요.', 4000, 0, 'N', 'N', '임밍아웃엽서 임신발표 초음파사진엽서 뱀띠용띠아기', 4000, 99, 21, 2);
