INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (87, '2025-03-07 22:14:17', '2025-03-18 22:28:17', 'Y', 'Y', '1144849611', b'0', '타임캡슐 우체통 편지 세트\n\n손글씨로 서로의 마음을 담아 우체통에 넣어 보관해서\nD-Day에 서로의 편지를 읽을 수 있도록 만들어진\n타임캡슐 편지에요📝\n\n\n사랑하는 연인끼리의 이벤트,\n남자친구를 기다리는 곰신과의 사랑스러운 약속들,\n온가족이 모여 편지에 마음 담아\n타임캡슐에 넣어보세요\n\n\n📆개봉하는 날짜에 감동은 더 커지고\n서로의 사랑과 믿음은 더 단단해질거에요', 8550, 5, 'N', 'N', '감동 선물 타임캡슐 우체통 편지지 커플 생일', 9000, 99, 21, 2);
