INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (85, '2025-03-07 22:14:16', '2025-03-18 22:28:17', 'Y', 'Y', '9580837572', b'0', '✨SPEDEAR 레트로 신작✨\n\n🔉목소리까진 전달하는 리얼 카세트 앨범🔉\n\n⭐⭐KBS 아기싱어 감동선물 바로 그 제품입니다⭐⭐\n\n\n시중에 비슷한 제품이 있지만, 어떤 차이가 있을까요❓\n\n⭐실제카세트 테이프에 사용되는 재질로 제작⭐\n디테일한 부분까지 확연한 차이를 알 수 있습니다🤗\n\n저희 스페디어는 단순히 비슷한 모양의 종이를\n파는 것이 아니라\n오랫동안 소장하실 수 있도록 실제 금형을 설계해서 만든\n카세트테이프와 동일한 재질로\n정성을 다해 제작하여 오래동안 견고하고\n더 소장 가치가 있어요\n\n\n자주 만나지 못하는 친구, 가족\n그리고 연인들과의 가득한 추억을\n음성과 함께 담은 카세트앨범 선물\n여러분만의 목소리를 담아 특별한 메시지를 전하세요🎁\n\n\n\n60초 정도의 직접 녹음해서 담을 수 있어요\n\n\n🌻#개인굿즈#커플선물#생일선물#친구선물#부모님🌻', 9205, 33, 'N', 'N', '음성을 전하는 카세트 앨범📻 음성 편지', 13900, 99, 21, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (84, '2025-03-07 22:14:15', '2025-03-18 22:28:17', 'Y', 'Y', '1433743302', b'0', '★이번에 준비한 상품은 여름을 발빠르게 준비하실 회원님들을 위해 준비했습니다.\n\n\n\n굽 높이가 5cm이상의 효과가 있지만 아주 가볍고 편안하게 신을수 있는 제품 입니다.\n\n전체적인 블랙톤의 색상에 네추럴 라인의 대다리 느낌이 고급스럽게 메치되는 제품으로 여름철 필수 아이템 입니다.\n\n★발에 닿는 모든부분들이 ★천연가죽★인 상품입니다.\n\n★기존의 샌들에서 찾아보기 어려운 고급스러움이 데일리룩에 포인트를 줄 수 있습니다.\n\n★마르카토는 우수한 기술력을 바탕으로 일본, 싱가폴, 홍콩 쪽으로 수출하며 대한민국 수제화를 알리고 있습니다.\n\n\n★소재★\n\n겉감 : 소가죽\n\n내피 : 천연 소 가죽\n\n아웃솔 : eva스폰지+파이롱\n\n★상품★\n\n칼라 : 블랙\n\n사이즈 : 구매란에 참고해주세요\n\n굽높이 : 5cm\n\n\n★신으시는 운동화 사이즈보다 한치수 작게 주문하세요★\n★마르카토의 열정과 수제화 장인분들의 기술력의 손맛과 멋을 느끼실 수 있는 상품입니다★', 91000, 4, 'N', 'N', '★여름 필수 아이템★ 벨라5cm ★', 95000, 99, 36, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (83, '2025-03-07 22:14:14', '2025-03-18 22:28:17', 'Y', 'Y', '8280931166', b'0', '에코클로그 크록스는 인터넷 최저가 47,000원?\n좋은 가격대로 할인 다~~ 받으셔서 저에게 보내주세요\n신고계신던 크록스도 작업진행 가능!\n\n아이디어스 주문 확인되면\n작업실 주소 보내드립니다.\n\n환경을 위해 택배 포장을 간소화 했습니다.\n포장 제거시 주의해주세요^^', 96000, 4, 'N', 'N', '파라코트 크록스 커스텀', 100000, 99, 36, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (82, '2025-03-07 22:14:13', '2025-03-18 22:28:17', 'Y', 'Y', '1482338623', b'0', '★마지막할인★남성첼시부츠★단3족할인★\n\n안녕하세요~!!!\n\n★이 겨울 지나가기전 첼시부츠 250/275/280 단 3족을 파격세일 진행합니다.\n\n\n★마르카토에서 엄성한 소가죽\n\n★내피(안감)까지 100% 소가죽\n\n★미끄럼방지 다이나이트 고무창\n\n★신고벗기 쉬운 밴드타입부츠\n\n★정상가 대비 저렴한 가격\n\n★소재★\n겉감 : 소가죽\n내피 : 소가죽\n아웃솔 : 고무창 / 홍창\n★굽높이 : 4센치', 91000, 4, 'N', 'N', '★마지막할인★남성첼시부츠★단3족할인★', 95000, 99, 36, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (81, '2025-03-07 22:14:11', '2025-03-18 22:28:17', 'Y', 'Y', '4286866367', b'0', 'F/W 시즌 인기 아이템 처커부츠 입니다.\n처커는 폴로 경기의 시합시간을 말하며\n원래 폴로 경기용의 승마화로 사용되었던 데서 유래되었습니다.\n발목 높이는 복사뼈가 가려지는 정도의 형태이며\n신고 벗기 용이하도록 옵션 선택에서 지퍼를 추가하여 제작 가능합니다.\n갑피(외피)는 편안한 착화감과 부드럽고 따뜻한 느낌의 소가죽 스웨이드를 사용하였습니다.\n내피 역시 전체 소가죽을 사용하여\n견고함과 고급스러움이 묻어나는 하이퀄리티 제품입니다.\n아웃솔은 가죽을 가공하여 제작한 홍창을 기본 적용하였습니다.\n\n본 상품은 주문제작 수제화로 7일~10일(주말/공휴일 제외) 정도의 제작기간이 소요됩니다.\n\n소재\n갑피(외피) : 소가죽 스웨이드 | 내피 : 소가죽\n아웃솔 : 가죽홍창\n겉굽높이 : 약 3cm / 안굽 1cm 또는 1.5cm 추가가능\n\n사이즈\n240mm ~ 290mm(5mm단위)\n평소 착용하시는 구두 사이즈로 주문해주세요.\n단, 브랜드 또는 종류에 따라 사이즈차이가 있을 수 있으니\n정확한 제작을 위해서 상품페이지 하단의 발사이즈측정방법을 참고하시어 주문시 주문메모란에\n실측 발사이즈를 기입해주시면 감사하겠습니다.\n\n제품을 받아보신 후 착화감은 고객님의 실제 발크기나 형태에 따라 약간 크거나 작을 수 있습니다.\n이 경우 현재의 착화감을 고려하여 최대한 고객님의 발에 맞게 사이즈보정이 가능하오니\n고객센터로 연락주시기 바랍니다.\n\n제품이미지는 고객님의 PC모니터 및 스마트폰 화면의 색감 및 밝기에 따라\n다소 색상 차이가 있을 수 있습니다. 이점 참고해주시기 바랍니다.', 235000, 1, 'N', 'N', 'MB4304 가죽홍창 스웨이드 처커 부츠 베이지', 239000, 99, 36, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (80, '2025-03-07 22:14:10', '2025-03-18 22:28:17', 'Y', 'Y', '4512557973', b'0', '✅ 나이키 에어포스 컬러는 화이트로 보내주세요.✅\n다른 컬러는 상담요청\n\n✅ 컨버스 운동화 대리구매 요청시 사이즈 메시지 보내주세요 ✅\n저희 신지커스텀에서는 대리구매 요청시\n정품인증된 신발로만 따로 받아서 구매 해드립니다.\n\n\n▶ Tip : 신발 사이즈(size)팁 정사이즈를 추천합니다.\n\n✅ 커스텀 제품 참고 사항 ✅\n커스텀은 페브릭 전용 페인트로\n유연성과 접착력이 좋은 고급 도료로 제작하기에\n내구성과 견고함이 뛰어나 지워지거나 번지지 않습니다.\nA/S는 3개월이며 드라이클리닝, 기계세탁으로 인하여\n커스텀이 지워질 경우\n리터칭 요청시 소정의 금액이 발생합니다.\n\n신발은 세탁을 하면 빨리 상합니다.\n그래도 청결을 위해 세탁하신다면\n발 안쪽으로는 손세탁을 권장하고,\n겉은 클렌징 티슈나 운동화 세척 티슈로\n닦으시는 것을 추천합니다.\n\n\n📍 배송 안내\n\n✅주문하신 모든 상품은 상담이 끝난 후 [주말, 공휴일을 제외]한\n평일 기준 8일~12일 이내로 발송됩니다.\n\n\n📍 교환 및 환불 안내\n\n✅ 고객님의 주문 요청사항에 따라 1:1 주문제작 된 상품으로\n주문 취소, 교환 및 환불은 불가합니다.\n\n그림을 판매하는 상품이기 때문에 환불은 어렵습니다.\n대신 완성도 사진을 확인 하시며, 수정 보완이 가능하오니\n신중한 구매 부탁드립니다.', 126000, 3, 'N', 'N', '물의호흡 귀멸의 칼날 / 컨버스 커스텀', 130000, 99, 36, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (79, '2025-03-07 22:14:09', '2025-03-18 22:28:17', 'Y', 'Y', '2727944445', b'0', '🚨 NOTICE 🚨\n\n모든 커스텀작업은 100% 핸드메이드로 꼼꼼하게 제작됩니다.\n\n상품마다의 제작기간이 다르며,\n최대 5-6주 (주말/공휴일 날짜에서 제외)까지\n소요 될 수 있습니다.\n\n고객님의 주문확인 후,\n"해당 사이즈 슈즈 제작 발주->커스텀작업"\n고객맞춤으로 진행되며 커스텀제작이 완료된 상품은\n교환/환불이 불가 합니다.\n\n[ 발 길이 미 실측으로 인한 사이즈 미스 /\n주문 요청시 컬러&이니셜 착오 / 제작 배송기간 / 단순변심 등의\n사유는 교환/환불이 적용되지 않습니다]\n\n📢 100% 나이키 정품으로 작업됩니다.\n___\n\n나이키 에어포스 1 운동화 [정품]\n: 🏀나이키 에어포스1 쓰리바운드 커스텀 🏀\n\n컬러 : 크림 + 그레이 + 네이비 콤비 (1컬러)\n\n⚠️ 좌우가 다른 스우시 테두리 포인트‼️\n좌 : 네온 오렌지 / 우 : 네온 옐로우\n\n나이키커스텀 구성 :\n정품 나이키 에어포스1 커스텀 운동화\n+나이키 박스 +더스트백\n기본 나이키 끈 + 커스텀 운동화끈\n\n이니셜 요청 : 한글/영어 가능\n양 발 안쪽 뒷꿈치 부분 (최대7자)\n\n특수 작업방식 으로 제작되어\n눈/비 에도 커스텀이 지워지지 않습니다.\n\n세탁방법 : 드라이/세탁기 금지\n(칫솔,솔/브러쉬 제외) 내피부분 찬물세탁 권장', 180000, 2, 'N', 'N', '🏀나이키 에어포스1 쓰리바운드 커스텀 [정품신발포함]', 184000, 99, 36, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (78, '2025-03-07 22:14:09', '2025-03-18 22:28:17', 'Y', 'Y', '1818052620', b'0', '1. CILI에서는 100% 정품 신발만 취급합니다!\n2. 중창에 들어간 디자인은 외부 요인에 의해 지워질 수 있습니다.\n3. 디자인은 수작업으로 진행되기 때문에 사소한\n하자가 발생될 수 있습니다.\n4. 배송 전 충분한 건조 및 꼼꼼한 검수가 이뤄집니다!\n5. 주문 후 사이즈 미스로 인한 환불이 불가하오니\n주문 전 구매자님의 신발 사이즈를 정확히 숙지 후 주문해주세요!\n6. 본 상품은 1:1 맞춤 제작 상품으로 단순 변심에 의한\n환불 및 취소는 어려울 수 있습니다.\n7. CILI는 전처리 과정, 메인 작업 과정, 후처리 과정에서\n매우 꼼꼼한 작업이 이루어 집니다! 완벽한 디자인 뿐만 아니라\n강력한 내구성에도 매우 신경쓰고 있습니다🔥\n8. 그 밖의 궁금하신 내용은 문의해주시면\n친절한 안내 도와드리겠습니다😊', 52316, 11, 'N', 'N', '에어포스1 2D 커스텀', 59280, 99, 36, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (77, '2025-03-07 22:14:08', '2025-03-18 22:28:17', 'Y', 'Y', '6952803386', b'0', '푼크트(PUNKT) 의 D.브라운 태슬로퍼를 소개합니다^.^\n\n\n\'PUNKT\' 는 최고급 자재와 기술력을 자랑하는 국내 수제화 브랜드 입니다.\n유튜브 남성스타일링전문채널 Classsy TV에서 수제화 부문 전속출연하고 있습니다.\n\n\n본 제품은 클래식 슈트와 세미정장, 캐쥬얼에 편하게 신으실 수 있는 태슬로퍼입니다.\n\n\n보시는 칼라는 다크브라운 칼라 이며 브라운, 블랙, 와인 등 저희가 보유하고 있는\n\n어떠한 가죽으로도 칼라 변경이 가능합니다.\n\n원하시는 색상이 다른 제품에 있으시면 말씀해주세요, 변경하여 제작 가능합니다.\n\n\n외피 소재는 소가죽을 사용하였구요\n\n내피까지 소가죽을 사용하여 최고의 착화감을 느끼시도록 노력하였습니다.\n\n\n기본 굽높이는 3cm 이구요. 별도의 키높이가 필요하신분은 메세지로 문의주시거나\n\n주문시 기입하여 주시면 겉굽 4cm(0.5cm 단위) 속굽 2cm 까지 하여 총 6cm의\n\n키높이구두로 제작 할 수 있습니다.\n\n\n주문 시 제작하는 제품이기 때문에 약 열흘의 제작기간이 소요됩니다.\n\n주문이 들어오면, 한분한분 상담 연락을 드린 후에 제작에 들어가고 있습니다.\n\n\n현재 저희 매장에서는 270,000원에 판매하고 있는데\n\n아이디어스에서는 입점기념으로 20% 할인하여 판매하고 있습니다.\n\n많은 관심 부탁드립니다.\n\n\n* 제품 받아보신 후 만족하신다면, 포토후기 부탁드려요^^ 저에게 큰 힘이 됩니다.', 212000, 1, 'N', 'N', '태슬로퍼 D브라운', 216000, 99, 36, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (76, '2025-03-07 22:14:07', '2025-03-18 22:28:17', 'Y', 'Y', '5060918524', b'0', '이번에 소개할 제품은 남성 패션의 베스트셀러입니다.\n\n모 드라마 주연배우가 신고나와 화재가 되었던 디자인으로\n\n해외 여러 브랜드에서 메인으로 선보이고 있는\n\n\n남성에겐 꼭 필요한 필수 아이템입니다.\n\n\n\n은은한 멋스러움과 어떤 의상과도 잘 어울리며\n\n광택감이 있어 항상 깨끗한 이미지를 연출하기에\n\n충분합니다.\n\n\n.\n마르카토는 유럽에서 질좋은 자재를 수입하여\n\n국내 손맛좋은 장인들의 노하우를 바탕으로\n\n최고의 제품을 생산하여 반대로 그 나라에 수출하고.\n\n있습니다.\n\n★비브람 아웃솔(창)★\n이태리 수입창이며, 전세계적으로도 상품의 퀄리티가 우수하여 다양한 업체와 브랜드에서 최고의 퀄리티 상품을 생산할 때 사용하는 아웃솔계의 명품입니다.\n\n지면과 밀착/논슬립이 우수하며, 내구성 또한 우수합니다.', 149000, 5, 'N', 'N', '마르카토 베스트 더비 특가 이태리 비브람', 158000, 99, 36, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (75, '2025-03-07 22:14:06', '2025-03-18 22:28:17', 'Y', 'Y', '4892730270', b'0', '이번에 소개할 제품은 유광 복스의 소가죽으로 제작된 클리퍼 입니다.\n\n습기에 강하고 관리하기에 편한 코팅 소가죽으로 은은한 광택이 멋스러운 제품 입니다.\n\n형식적인 옷차림에서 활동적인 옷차림으로 크게 변화된게 시대의 흐름에도 잘 맞는 스타일 입니다.\n\n작품을 소개 하다보면 시대가 많이 변화된걸 느끼게됩니다.\n\n이번에 소개할 작품은 그런 시대 흐름을 잘 겨냥하고있어요.\n\n화려한듯 화려하지않고 캐쥬얼엔 물론 타이를 생략한 정장 스타일에도 문안하게 매치되는 디자인 입니다.\n\n이 디자인은 젊은 층에 꾸준한 인기를 받고있는 스타일로\n이태리 비브람사의 대표적인 크리스티 몰플렉스를 아웃솔로 사용하고 있고 외피는 물론 내피에까지 최고급 소가죽을 사용해서 최고의 퀄리티를 자랑합니다.\n\n너무나 가볍고 편안한 구두로 작가가 자신있게 권장하는 작품입니다.\n유사한 작품을 통틀어 국내는 물론 세계 어느 나라 작품과 비교하셔도 자신있는 작품입니다.', 261000, 3, 'N', 'N', '마르카토 클리퍼 밀러 (20%)', 270000, 99, 36, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (74, '2025-03-07 22:14:06', '2025-03-18 22:28:17', 'Y', 'Y', '8007460018', b'0', '저희 블르와 신발은 100% 맞춤제작 신발입니다.\n\n나만을 위한 신발, 세상에 하나 밖에 없는 신발을 만들고 있습니다.\n\n고객님이 저희 디자인을 선택해 주문해 주시면\n저희가 주문건을 확인후 연락드리고 여러가지 가죽 샌플, 다양한 굽등을 고객님에게 보내드리고,\n\n고객님이 주문하신 디자인에 가죽색상, 굽등을 선택해 주시면 그때 제작이 들어가는 시스템입니다..\n\n제작 기간은 가죽 색상이 정해지면 10일정도 소요된다고 보시면 될것 같아요.\n\n다른 곳에서는 경험해보지 못한것을 저희 블르와에서 한번 경험해 보세요.\n\n고객님이 직접 디자인한 나만의 신발을 만들어\n보세요.\n\n(결정장애[혼자 결정을 못하시는 언니]가 있는 언니들은 저희가 도와드려요...넘 걱정마세요.ㅋㅋ)', 141000, 2, 'N', 'N', '가죽 수제화 샌들 힐', 145000, 99, 35, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (73, '2025-03-07 22:14:05', '2025-03-18 22:28:17', 'Y', 'Y', '6857089736', b'0', '모던하고 심플한 라인에 부담없이 데일리로 착화할 수 있는\n쉐입의 앞코라인이 발볼을 매끄럽고 작게 연출해 주는 앵클부츠입니다.\n\n볼드하게 떨어지는 5CM 딱 적당한 높이와\n폭신폭신 쿠션감있는 인솔로 발이 편안하여\n균형잡힌 착화감을 느끼실 수 있고\n바디와 조화가 잘어울립니다.\n\n천연소가죽 소재로 제작되어 착화감도 우수합니다.\n\n다가오는 겨울부터 봄까지 쭉 신기 좋으신 라인이 예쁜 앵클부츠 데일리 슈즈로 추천드립니다^^\n\n컬러는 기본컬러 3가지로 구성되어있으며\n취향에 맞게 쵸이스 하시면 좋으실것같아요~\n\n\n사이즈는 정사이즈 권장드리며\n발볼이 넓으시거나 부츠라 여유있게 신기를 원하시는 분들은\n한치수 크게 권장 드릴께요~', 56050, 5, 'N', 'N', '라인이 예쁜 소가죽앵클부츠 5cm-3col', 59000, 99, 35, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (72, '2025-03-07 22:14:02', '2025-03-18 22:28:17', 'Y', 'Y', '8786167791', b'0', '<4년 연속 고객만족도 No.1>\n\n곧 전역인데 여자친구를 위한 선물, 준비하셨나요?🌸\n\n언제나 사랑스럽게 스타일링 할 수 있는 데일리 스니커즈!\n\n다양한 데일리룩에 자연스럽게 녹아들 수 있는\n로맨틱한 무드로 연출한 꽃신으로 준비해보세요 :)\n\n\n‼️주문후 제작 소요 기간은 최소 7일‼️\n\n"감동 백배로 늘리는 선물하는 방법"\n🎁\n\n선물포장 옵션\n\n🌸꽃신박스 (250사이즈 까지만 추천)🌸\n*에어캡 이중 포장으로 배송중 파손위험을 보완했습니다 *\n\n💌\n선물용으로 구매하시는 모든분들께\n예쁜 편지지에 정성껏 손편지를 적어드립니다.\n\n(옵션에서 추가후 내용은 작가 메세지로 보내주세요.)\n\n📌\n많이 물어보시는 질문들 정리!\n\n1. 세탁이 가능한가요?\n\n물론 가능합니다. 다만 꼭 손세탁을 권유드리고\n작은 오염은 세탁용 물티슈로 지워주시고\n손세탁시 부드러운 칫솔모를 이용하여\n세제를 최대한 적게 사용해주세요!\n\n2.꽃신박스 내부 꽃은 조화인가요?\n\n네 그렇습니다.\n따라서 오래 보관하셔도 형태 변형없이\n유지가 가능하며 안전하게 보내드리기 위해\n에어캡으로 이중 포장하여 보내드립니다!\n\n궁금하신 점은 언제든 작가 메세지를 통해\n문의 주시면 상세히 안내드리겠습니다🙇‍♀️❣️', 145000, 2, 'N', 'N', '🌸여자친구 선물 봄맞이 벚꽃 꽃신커스텀', 149000, 99, 35, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (71, '2025-03-07 22:14:01', '2025-03-18 22:28:17', 'Y', 'Y', '2404126366', b'0', '신발에 이야기를 담는 슈즈텔러\n커스텀 비움 입니다.\n\n이번 신발은 나이키 에어포스1에 작업한\n우주빛 페인팅 입니다.\n\n영롱한 우주의 은하수를 신발에 담고\n싶으시다면 커스텀 신발을 주문해보세요🙂\n\n남녀노소 누구나 어울리고 특별하게 신을 수\n있답니다✨️', 118000, 1, 'N', 'N', '나이키 에어포스1 우주 커스텀 신발', 120000, 99, 35, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (70, '2025-03-07 22:14:00', '2025-03-18 22:28:17', 'Y', 'Y', '9656603741', b'0', '둥근 앞코가 귀여운 플랫펌프스♡\n\n매일 신고싶은 편안한 플랫슈즈로\n부드러우면서 탄성이 좋아 발을 편안하게 감싸줍니다.\n\n앤틱한 느낌이나는 컬러사용으로 더욱 멋스러우며\n\n다양한 컬러 선택과 (9col)\n폭넓은 사이즈 선택이 가능하여 (230mm~270mm)\n왕발이시거나 볼이 넓으신 분들도 사이즈 고민없이\n선택하실수 있는 마음좋은 플랫슈즈입니다.\n\n어디든 코디가 쉬운 둥근코 플랫슈즈는\n매일 일상에도 특별한날에도 다양한 장소에서도 활용하기 좋은 아이예요.\n\n1.5cm 적당한 굽으로 가볍고 편해서 쇼핑,여행가실때도 안성맞춤이예요~\n\n볼이 여유있게나와서 볼에 상관없이 고객님 기장에 맞춰서 신으시면 되십니다.\n\n사이즈가 10단위로 나와서 5단위 고객님께서는 (예를들어 235 고객님께서는 240을 주문하시고 "깔창"요청하시면 깔창을 보내드립니다.)\n꼭 참조해주세요~', 35900, 10, 'N', 'N', '둥글둥글 귀여운 플랫펌프스 - 9col', 39900, 99, 35, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (69, '2025-03-07 22:13:58', '2025-03-18 22:28:17', 'Y', 'Y', '3033916088', b'0', 'Baby Daisy Flower Mary-jane Flat shoes_23SS\n\n사랑스럽고 우아한 디자이너 슈즈,\n🌷부티크헤르원입니다. 🌷\n\n안녕하세요 HERWON입니다.\n\n작은 들꽃이 스트랩위에 피어있는 HERWON의\n데이지 플라워 스트랩 플랫을 소개해드립니다!\n\n동그랗고 귀여운 앞코가\n소녀스러운 감성을 더해줍니다.\n\n\n⭐️\n\n헤르원내 모든 슈즈는\n-고품질의 가죽으로 제작해드립니다.\n-이중에어쿠션으로 편안한 착화감 선사해드립니다.\n-커스터마이징이 가능합니다.\n\n\n배송기간 10~ 14일 소요되는 점 안내드립니다.\n받으셔야하는 날이 있으시다면 사전에 말씀해주세요.^^\n\n🌼 색상 :\n블랙,베이지\n*헤르원내에 모든 색상과 소재로 선택가능합니다.\n\n🌼 굽높이 :\n3 5 6 cm\n\n🌼 SIZE :\n220~255 mm\n\n🌼 Size tip : 정 사이즈\n발볼이 있으신 분은 주문시 발볼 늘림(약간+1/중간+2/많이+3)을 요청해주세요.^^\n\n1:1 주문제작 상품입니다.', 145150, 4, 'N', 'N', 'BabyDaisy 베이비 데이지 메리제인 플랫 23FW', 152150, 99, 35, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (68, '2025-03-07 22:13:57', '2025-03-18 22:28:17', 'Y', 'Y', '4055830257', b'0', '😄안녕하세요~ 룩스투아(LuxTua) 입니다!\n\n\n오늘 소개해 드릴 작품은 클라시코 메리제인입니다!!\n\n\n클라시코 로퍼에 이어 메리제인까지 나왔어요~~😍\n이번에 새로 디자인한 클라시코 메리제인은\n명품 브랜드에서 많이 사용되는\n최고급 키프가죽으로 제작하였습니다.\n\n키프가죽의 부드러운 특성과 저희 룩스투아만의\n클래식한 감성으로 재탄생된\n‘클라시코 메리제인’ 을 소개합니다~!!\n\n\n\n-ORGANIZATION-\n\n이번에 디자인 한 클라시코 메리제인은\n\n🍊 Orange Brown\n\n🍒 Burgundy\n\n🖤 Black\n\n총 3가지 색상으로 구성되었습니다.\n\n\n\n저희 룩스투아(LuxTua)는\n1:1 오더 메이드 방식입니다.\n\n\n\n발볼이 넓으시거나 발등이 높으신 분들은 넓힘을 선택해 주시면 더욱 편안하게 신으실 수 있습니다~~😍', 165000, 2, 'N', 'N', '블랙라벨 🖤 클라시코 메리제인', 170000, 99, 35, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (67, '2025-03-07 22:13:56', '2025-03-18 22:28:17', 'Y', 'Y', '2053070132', b'0', '✔에작가 comment✔\n\n차분한 감성으로 품위를 높여주는 매우 편한 데일리 양가죽 로퍼를 소개할께요!\n\n부드러운 양가죽 소재로 제작되어 가볍고 부드러우며 가을부터 봄까지 꾸준히 사랑받는 아이예요~\n\n착화감은 물론 심플한 디자인으로 오피스룩 모임룩 여행룩 어디든 믹스매치가 가능하여 활용도도\n아주 좋은 야무진 로퍼 입니다.\n\n﻿잘빠진 쉐입의 슈즈라인에 꼬임스트랩 포인트로\n여성스러움과 세련미를 더했으며\n양가죽의 소프트한 질감의 소재로 기분좋은 부드러움에 반하실거예요~\n뒷꿈치부분에 밴딩을 넣어 뒷축을 더 안정적으로 잡아주었구요~\n\n컬러는 기본컬러인 아이보리,블랙과\n요즘 반응이 좋은 포인트컬러 실버 총3컬러로 구성했어요~\n\n이지 탈착화가 가능한 부드러운 양가죽 꼬임 뒷밴딩 로퍼 추천드릴께요~\n\n\n✔﻿PRODUCT DETAIL✔\n\n#품번(S/#) : ﻿202207\n\n#원산지 : made in korea 성수\n\n#소재(MATERIAL) : 양가죽\n\n#컬러(COLOR) : 블랙,아이보리,실버\n\n#사이즈(SIZE) : 235/240\n\n#발볼 : 8CM\n\n#굽높이(HIGH) : 2CM\n\n#사이즈팁(SIZETIP) : 정사이즈 권장 드립니다.\n발볼이 많이 넓으신 분들은 한치수 크게 권장드릴께요~﻿', 75050, 5, 'N', 'N', '꼬임 양가죽 뒷밴딩 로퍼', 79000, 99, 35, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (66, '2025-03-07 22:13:55', '2025-03-18 22:28:17', 'Y', 'Y', '9565902215', b'0', '✔MD COMMENT\n\n예.쁨.주.의 쁨슈\n\n◀성수동수제화 양가죽 블랙 리본펌프스 6cm▶\n\n\n쁨슈 자체제작 NEW ITEM !!\n\n﻿\n스틸레토 앞코 쉐입의 리본장식이\n\n돋보이는 펌프스에요\n\n\n\n6cm의 굽으로 데일리로 신기에\n\n아주 좋은 구두랍니다.\n\n\n\n라운드 커팅 라인이 발등을 예쁘고\n\n자연스럽게 커버해주고\n\n스틸레토 앞코가 세련된 무드를 더해주는\n\n미들힐입니다.\n\n\n\n큰 리본 디테일이 러블리한\n\n포인트를 주는 슈즈이기에\n\n꼭 쟁여둬야 할 아이템이에요.^^\n\n\n부드러운 쁨슈만의 착화감으로 선보입니다.\n\n\n고퀄리티의 만족스러운 소장가치 높은 슈즈\n\n초이스 해 보세요~^^\n\n\n✔ COLOR\n블랙\n\n✔ 정 사이즈\n\n✔굽높이 2,3,4,6,7,8cm( 굽높이 변경가능)\n\n✔앗 잠깐만요!\n구매전 충분히 숙지 부탁드려요~\n▶기장/둘레 변경은 꼭 상담부탁드려요\n▶1:1 주문제작 형식으로 사이즈 미스로 인한 교환은 1회(왕복택배비 구매자부담)/\n기본에서 굽,발볼 등 여러 옵션변경시 단순변심으로는 교환 및 환불이 불가할 수 있습니다. 신중 구매해주세요\n(단, 작품자체에 불량 및 문제는 교환 및 환불 도와드릴 것이며, 메세지를 통한 상담부탁드려요▶\n\n/ 상 점 정 보/\n저희 쁨슈 제품은\n국내 생산 가죽 원단과, 기타 국내 소재로\n수제화 장인이 직접 제작하는 수제화입니다\n또한 가족이 경영하는 공장이기에\n퀄리티뿐만 아니라 마진을 최소화하여\n고객님께 가성비 좋은\n수제화를 선보일 수 있었답니다\n인터넷으로 판매한지 오래되지는 않았지만\n수제화 매장은 한지 오래된 전문숍입니다\n타 사이트 또는 로드숍 매장에서는 훨씬 비싼 퀄리티의 수제화들입니다\n착화해보시는 분들이 또 주문 주시는 쁨슈예요~', 95000, 4, 'N', 'N', '성수동수제화 양가죽 블랙 리본펌프스 6cm', 99000, 98, 35, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (65, '2025-03-07 22:13:54', '2025-03-18 22:28:17', 'Y', 'Y', '6437658842', b'0', '저희 블르와 신발은 100% 맞춤제작 신발입니다.\n\n\n나만을 위한 신발, 세상에 하나 밖에 없는 신발을 만들고 있습니다.\n\n\n고객님이 저희 디자인을 선택해 주문해 주시면 저희가 주문건을 확인후 연락드리고 여러가지 가죽 샌플, 다양한 굽등을 고객님에게 보내드리고,\n\n\n고객님이 주문하신 디자인에 가죽색상, 굽등을 선택해 주시면 그때 제작이 들어가는 시스템입니다..\n\n\n제작 기간은 가죽 색상이 정해지면 10일정도 소요된다고 보시면 될것 같아요.\n\n\n다른 곳에서는 경험해보지 못한것을 저희 블르와에서 한번 경험해 보세요.\n\n\n고객님이 직접 디자인한 나만의 신발을 만들어\n보세요.\n\n\n(결정장애[혼자 결정을 못하시는 언니]가 있는 언니들은 저희가 도와드려요...넘 걱정마세요.ㅋㅋ)', 141000, 2, 'N', 'N', '블르와 리본 펌프스 힐', 145000, 99, 35, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (64, '2025-03-07 22:13:53', '2025-03-18 22:28:17', 'Y', 'Y', '5317553311', b'0', '색동 노방 뷔스티에\n자체제작 색동노방\n\n으로 만들었습니다.\n\n양면으로 입으실 수 있어요.\n\n반대편에는 아래와 같은 네이비 컬러의\n\n물명주로 구성했습니다.\n\n사이즈 Free\n44~88', 94000, 4, 'N', 'N', '색동 노방 뷔스티에', 98000, 99, 33, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (63, '2025-03-07 22:13:52', '2025-03-18 22:28:17', 'Y', 'Y', '2259554907', b'0', '현대의 스퀘어넥의 형태와 유사한 형태를 보이는\n방령깃을 모티브로 활용하여\n현대적으로 해석한 원피스입니다.\n\n여성의 곡선미를 살린 상의와\n전통 치마저고리 특유의\n둥글고 우아한 실루엣(상박하후)을 담은\n풍성한 치마를 통해\n전통과 현대의 순간이 이어지도록 디자인하였습니다.\n\n한복의 우아한 실루엣을 그대로 차용한 높은 허리선과\n긴 기장감으로 날씬하고 다리가 길어보여\n체형보완에 효과가 있으며,\n\n민소매가 부담스러우신 분들은\n\'오늘 덧저고리\'와 세트로 착용하시면\n활동성과 함께 한복의 멋스러움을\n한층 더 깊이 즐기실 수 있으며,\n슬림한 핏의 티셔츠와 레이어드하여\n캐주얼하게 연출해주셔도 좋습니다.\n\n<소재>\n사계절 모두 착용이 가능한\n가볍고 바스락 거리는 느낌의 코튼나일론 혼방 소재로\n아이보리, 네이비, 차콜 3가지 베이직 컬러와\n블루그레이, 카키 2가지 포인트 컬러로\n어떤 계절이든 스타일리쉬하게 입으실 수 있습니다.', 116000, 3, 'N', 'N', '하루한복원피스, 5 color', 120000, 99, 33, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (62, '2025-03-07 22:13:52', '2025-03-18 22:28:17', 'Y', 'Y', '3126612189', b'0', '한정수량! 필수구매!\n추가 생산 X\n소담상회 _인사 오프라인과 동시 판매되고 있습니다.\n재고 소진시 구매 불가합니다.\n현재(25.1.26)\n모카색상 9벌 남았어요!!\n민화 품은 도포 코트 \n반품 및 환불 진행시 배송비(8,000원)발생됩니다.\n완제품으로 제작된 상품으로\n한정판으로 제작되었습니다.\nㅡ\n코트 무게를 별도 측정해보지는 않았지만\n택배 발송시 택배 박스 포함 무게\n평균 1.8kg~2kg 넘지 않았습니다.\nㅡ\n박스 내용물\n코트,옷걸이, 부토니에\n스냅단추여분, 실리카겔\nㅡ\n\n맞춤 및 수선 제작이 불가합니다.\nㅡ\n13시전까지 주문 확인시\n당일 출고 접수 진행됩니다.\n\n토요일 12시 이후 주문시\n월요일 발송접수 됩니다.', 123000, 2, 'N', 'N', '무배 민화 품은 도포 한복 코트', 126000, 99, 33, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (61, '2025-03-07 22:13:51', '2025-03-18 22:28:17', 'Y', 'Y', '1861046084', b'0', '#한텐? 아니요 마고자인데요?\n#센스있는선물 #마고자 어떠세요?\n여러분의 찬란한 겨울나기를 위해,\n조금 더 특별한 +홀리데이에디션+ 신상이 입고되었습니다!\n\n1. 마고자, 배자의 본연의 매력을 헤치지 않았습니다.\n깃, 동정이 생략된 깔끔한 넥라인과 뚝 떨어지는 실루엣, 둥근 소매, 옆트임까지. 우리나라 전통 마고자, 배자의 특징을 그대로 살렸습니다.\n\n2. 입었을 때 이불처럼 부드럽고 따뜻합니다.\n면 100% 코듀로이 원단에 뽀글이까지 더해 엄청난 따뜻함을 선사합니다! 원단이 폭닥폭닥 부드러운 건 말할 것도 없죠.\n\n3. 트렌디한 오버핏으로 누구나 깔끔하게\n불편하게 끼이는 느낌 없이 적당히 여유로운 오버핏으로 제작되었으며, 다양한 체형을 가진 사람의 피팅을 거쳐 공용으로 입을 수 있도록 만들었습니다. 슬림핏이 아니라서 얼마든지 껴입을 수 있다는 것도 큰 장점이죠!\n\n4. 안정적인 기장으로 편안함과 따스함까지.\n한복 기장이 짧아 느끼는 불편함은 우리 겨울옷에서는 느끼실 수 없어요. 힙을 안정적으로 덮어 주는 만큼 따듯한 보온성을 느껴보실 수 있습니다.\n\n5. 이거 하나면 원마일룩 뚝딱.\n한복에 빠지신 분들은 아실거예요. 우리옷이 얼마나 편안한 삶의 궤적을 남기는지. 활동성을 헤치지 않습니다. 마음껏 움직이세요!\n6. 수면 시에도 불편함은 제로.\n목 부분에 깃, 동정이 없고 수면 시 착용해도 불편하지 않아요.\n7. 겨울필수품인 귤과 핸드폰을 넣을 주머니도 장착 완료.\n현대인의 옷에 주머니는 필수 아닌가요? 폭닥한 주머니에 손을 넣으면 어느 새 기분도 몽글몽글 따듯해져요.\n8. 평상복과도 어우러지는 디자인\n집에서만 입냐고요? 아니요! 외투로 입으면 얼마나 멋스러운데요. 원피스와도, 도톰한 니트와도 레이어드가 정말 잘 어울려요. 평상복과도 전혀 어색하거나 붕 뜨는 느낌없이 부드럽게 매치하실 수 있답니다.\n\n9. 고민의 시간은 그만. 목도리까지 같이 드려요\n포근한 뽀글이 목도리와 어울려 더욱 따듯한 분위기가 올라오는 마고자. 추가금 없이 세트랍니다.\n10. 한국산 100%, 소재감, 퀄리티도 챙긴 우리 겨울옷\n너무나도 당연히 한국산 원단으로 한국 공장에서 만들어집니다. 휘뚜루마뚜루 데일리하게 입기 좋지만 하나하나 세심한 디테일을 고심해 제작했습니다 \n11. 다양한 디자인으로 즐기는 우리 겨울옷\n무려 양면!!으로 착용할 수 있는 리버서블 디자인으로 활용도까지 챙겼습니다.', 97000, 2, 'N', 'N', '뽀글이양면+목도리세트 자켓', 99000, 99, 33, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (60, '2025-03-07 22:13:50', '2025-03-18 22:28:17', 'Y', 'Y', '3404691739', b'0', '모란꽃 무늬의 예쁜 레이스 원단으로\n퓨어하고 단아한\n모란꽃 레이스 저고리를\n소개합니다 :)\n\n고급 코드사 레이스 원단으로\n꽃무늬가 너무 예쁘게\n드러나는 소재에요\n레이스 원단은 많이 보았지만\n모란꽃 무늬의 레이스에 한눈에 반해서\n저고리로 제작하게 되었답니다 ^^*\n\n몸판은 스판사가 섞여 있는\n고급 안감을 사용하여\n편안하게 착용 하실 수 있도록 제작했어요\n소매는 레이스에 홑겹으로 제작되어\n가볍고 편안하게 입을 수 있어요~\n\n옷선한복 만의 이중깃 스타일로 세련되면서도\n목부분에 닿는 부분이 엄청 편해요\n몸판의 양옆으로 트임을 주어\n움직임도 편하고,\n슬림해 보이는 실루엣으로\n한 치수는 더 작아보인답니다 >◡<\n\n안 고름 한번 여미고\n겉에서 고름을 묶는 디자인이라\n체형에 따라 여유있게\n착용하실 수 있도록 제작했어요\n\n소매단에는 예쁜 매화꽃수를 놓아\n한층 더 여성스럽고 러블리한\n느낌이 나는 저고리구요 ^^\n소매도 볼륨감을 주어\n여성스러운 실루엣으로\n단아하고 우아 하답니다 ~\n소매진주 단추도 Swarovski 정품으로\n벗겨짐 없이 영롱한 진주빛으로\n엄~청 고급스러워요 ๑^ᴗ^๑\n\n가장 기본적인 색상으로\n치마, 바지, 슬랙스 등\n어디에나 잘 어울려서\n코디하기가 쉬운 저고리랍니다.\n\n결혼식 하객룩이나\n갖춰 입어야 하는 자리에도\n너무 예쁘게 코디할 수 있어요', 66300, 10, 'N', 'N', '모란꽃 레이스 저고리', 74000, 99, 33, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (59, '2025-03-07 22:13:49', '2025-03-18 22:28:17', 'Y', 'Y', '8912925083', b'0', '여성스러운 패턴이 예쁜\n윤슬_레드 허리치마를\n소개합니다 :)\n\n기본 네이비 색상으로\n포인트 원단으로 예쁘게 디자인 되었어요\n\n촉감이 좋은 폴리 소재로\n편안하게 입으실 수 있으며,\n조직감이 탄탄하여\n살짝 두께감 있어\n봄, 가을, 늦가을까지\n예쁘게 착용하실 수 있어요 ^^*\n\n까슬거림 없이 부드럽고,\n비침도 없으며\n몸에 달라 붙지 않고\n부드럽게 촤르르 떨어지는 소재입니다.\n\n예쁜 패턴으로 포인트를 주어\n특이하고 세련된 디자인으로\n여며지는 폭으로 블록 단추를 달아\n움직이실때 벌어지지 않게\n편하게 착용하실 수 있어요\n\n허리에 고무줄이 살짝 들어가있어\n더 편하게 입을 수 있어요\n\n롱한 기장감으로\n여성스럽고 사랑스럽게 *^^*\n\n옷선한복의 나비 저고리나 라온 저고리와\n함께 연출 하셔도 예쁘답니다 >o<\n\n티셔츠, 니트, 블라우스와도\n무난하게 착용할 수 있어요\n\n일상에서도 편안하고\n예쁘게 착용할 수 있는\n윤슬_레드 허리치마를\n추천드립니다 :)', 48250, 12, 'N', 'N', '윤슬 레드 허리치마', 55000, 99, 33, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (58, '2025-03-07 22:13:48', '2025-03-18 22:28:17', 'Y', 'Y', '6296824760', b'0', '한복 치마 안에 입는\n풍성한 속치마입니다.\n\n*** 검정 샤넬 속치마가 추가되었어요~~ ***\n\n한복의 치마 라인을\n더욱 예쁘게 살려주는 속치마에요\n\n한복속치마 겉감은\n자연스러운 광 샤넬노방 으로\n3단 캉 치마입니다.\n\n세탁 후에도 예쁜 볼륨으로\n입으실 수 있답니당~~\n\n바느질이 좋은 속치마로\n와이어링 없이 제작되어\n풍성하고 편안하게 입을 수 있어요\n\n사이즈는 한 사이즈로\n기존의 허리치마 처럼\n둘러 입도록 제작해서\n체형에 맞게 착용 가능해요\n\n사이즈// cm\nFree\n88까지 입으실 수 있어요\n말기장 103\n말기너비 7\n총장 65cm (말기포함)\n~~길이 조정 은 불가합니다.~~\n**재는 방법에 따라 사이즈 오차 1~3cm', 48250, 12, 'N', 'N', '샤넬 검정 허리속치마', 55000, 99, 33, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (57, '2025-03-07 22:13:47', '2025-03-18 22:28:17', 'Y', 'Y', '4397071247', b'0', '훈민정음 3번째 시리즈 한복! ⭐️\n언밸런스한 디자인으로 유니크한 매력을 느낄 수 있어요!\n훈민정음 언밸런스 금박 나그랑저고리와\n같이 커플룩으로 연출할 수 있어요!\n저고리 별도 구매 가능합니다 :)\n\n* 단면 기준 (cm) *\n\n44~55 :: 어깨 37 / 가슴 45 / 소매 59\n66~77 :: 어깨 39.5 / 가슴 50.5 / 소매 60\n88이상은 맞춤 비용 별도 추가됩니다 :)', 128250, 5, 'N', 'N', '생활한복 훈민정음 언밸런스 매화 금박 철릭원피스 블랙', 135000, 99, 33, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (56, '2025-03-07 22:13:46', '2025-03-18 22:28:17', 'Y', 'Y', '6063117663', b'0', '< 수막새 기와 저고리>\n여행을 가면 로컬에서 만 느낄 수 있는 영감이 있습니다. 다른 형태의 집 구조, 자연 풍경은 우리를 설레게 하죠. 이번에 뽀뿌리가 준비한 한복은 전통 가옥 구조와 풍경에서 영감을 얻었습니다.\n\n\n어깨너비 가슴반품 뒷기장 소매길이\n\nS 37 45 40 60\nM 39 47.5 41 61\nL 41 50 42 62\nXL 43 52.5 43 63\nXXL 45 55 44 64', 99000, 3, 'N', 'N', '수막새 기와 저고리', 103000, 99, 33, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (55, '2025-03-07 22:13:46', '2025-03-18 22:28:17', 'Y', 'Y', '3986486640', b'0', '입는 순간 화~사해지는\n여성스럽고 사랑스러운\n아이꽃 홑겹 날개치마를\n소개합니다 :)\n\n**홑겹 치마 단품 판매 입니당**\n\n예쁜 꽃 나염 노방 소재로\n보드랍고 얇아서\n하늘하늘 거리는 느낌으로\n사랑스러운 분위기를 연출한답니당~\n\n보면 볼수록 예쁜 프린팅으로\n봄내음이 물씬 나요~\n\n안이 비치는 시스루 덧치마로\n랩스커트 처럼 허리에\n둘러서 입는 홑겹 허리치마에요\n다른 디자인의 허리치마나\n철릭 원피스에 매치하시면\n러블리한 분위기를 연출할 수 있어요\n\n허리 말기는 탄탄하게 제작하여\n잡아주는 힘이 있어\n편하게 착용 할 수 있고\n아이보리 양단으로\n허리끈을 제작하여\n훨씬 고급스러워 보여요~\n\n기본색상인 아이보리에 꽃무늬로\n다른 치마와 매치해서 입기\n너무너무 좋답니다~~\n\n샤넬 속치마 위에 입기만 하셔도\n한복 드레스 같은 분위기에요~\n\n옷선한복의 다른 치마와\n매치 하시기 너무 좋으실꺼에요 ^^\n\n미엘, 러블리, 마루 치마 라인에\n함께 코디하시면\n프로필 촬영이나 스냅촬영 하실 때에\n너무 특별하고 예쁘게 좋으실 것 같아요.\n\n기본 스타일에서 간편하게 분위기를\n변화시킬 수 있는 아이템으로\n기분 전환 하기에도 너무 좋은\n아이꽃 홑겹 날개치마를\n추천드립니다 :)', 64400, 10, 'N', 'N', '아이꽃 홑겹 날개치마', 72000, 99, 33, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (54, '2025-03-07 22:13:45', '2025-03-18 22:28:17', 'Y', 'Y', '0946682752', b'0', '세련되고 매력적인\n미엘_그레이 롱 허리치마를\n소개합니다 :)\n\n회색빛 색감이 세련된 한복지에요\n부드럽고 하늘 거리는 원단으로\n오간자, 크리스탈, 슬라브\n3겹으로 제작하여 힘있고 풍성하게 입을 수 있어요\n\n손으로 한 땀 한 땀 주름잡아 자체 제작되어\n볼륨감이 좋아 착용시 날씬해 보입니다.\n\n주름부분은 원단이 겹쳐 색상이 더 진해보이고\n아래로 갈수록 연해보여\n그라데이션 된 것처럼\n오묘하고 신비롭게 색이 예뻐요\n\n허리끈은 치마색상과 같이 매치해서\n단아하고 우아한 분위기로\n연출하실 수 있어요~\n\n롱한 기장감으로\n여성스럽고 사랑스럽게 *^^*\n\n옷선한복의 나비 저고리나 라온 저고리와\n함께 착용 하셔도 예쁘답니다 >o<\n\n어느 색상에나 예쁘게 어울리는\n매력적인 회색빛으로\n무난하게 착용할 수 있어요\n\n일상에서도 편안하고\n예쁘게 착용할 수 있는\n미엘_그레이 롱 허리치마를\n추천드립니다 :)', 48250, 12, 'N', 'N', '미엘 그레이 롱 허리치마', 55000, 99, 33, 2);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (53, '2025-03-07 22:13:44', '2025-03-18 22:28:17', 'Y', 'Y', '5633023589', b'0', '전체 써지컬스틸 발찌 입니다.\n모든 재료는 써지컬스틸로 제작됩니다. ❤️\n\n✔️사은품 선물케이스 증정.\n\n✔️써지컬스틸이란?\n무변색, 무알러지로 외과수술 메스에 사용되는 소재입니다.\n써지컬스틸에는 니켈 성분이 없거나 적기 때문에,\n알레르기 반응이 잘 일어나지 않습니다.\n\n금속 자체에 알레르기가 있으신분은 신중히 구매하시고,\n사용 후 조금이라도 문제가 있을 시 사용을 즉각 중단해주세요.\n\n✔️선명하고 뚜렷한 레이저로 각인 해드립니다.\n\n\n📌 구매방법 📌\n\n1. 글씨체 선택 ( 이미지 참조)\n2. 주문요청 사항에 팬던트 각인문구를 입력해주세요~!\n(문구가 길어지면 글씨가 작아져요.5자 이하로 부탁드려요.)\nEX) SH\nEX) 미르\n\n📌 구매전 확인사항 📌\n\n총 사이즈 : 21cm + 4~5cm(꼬리체인)\n(사이즈 변경을 원하시면 주문요청사항 또는 메세지로 입력해주세요~)\n\n팬던트 : 1.5cm x 0.4cm\n\n주문확인 후 제작이 이루어집니다.\n주말 공휴일 제외 3일 이내 발송됩니다.\n\n- 주문제작 -\n\n“상품준비중” 일경우 주문취소 및 내용 변경이 어렵습니다.\n\n- 교환/반품 -', 6900, 0, 'N', 'N', '써지컬 발찌 미니바 체인Q', 6900, 99, 26, 1);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (52, '2025-03-07 22:13:44', '2025-03-18 22:28:17', 'Y', 'Y', '1799162606', b'0', '좋아하는 작가 ❤ 누르시면\n매달 더 많은 할인쿠폰 및 이벤트\n소식들을 받아보실 수 있습니다😆\n\n925실버 실크 라인과 클래식한 체인 라인이\n레이어드 되어 엣지 있게 연출해줍니다\n모던 심플한 두줄 라인이 레이어드\n되어 유니크함을 더해주며, 시원하게\n돋보이는 실버 만의 고급스러움을\n한층 더 업그레이드 해줍니다:)\n\n발목을 더 돋보이게 해주어 존재감\n있는 데일리 발찌로 좋은 상품이에요~\n\n소재\nSILVER 92.5\n\nSize\n발찌-줄길이 22cm + 3cm(여유분 줄)\n\n여유분 줄이 있어 길이 조절도 가능해서\n사용하시기 편리합니다~\n\n\n🚚 배송\n배송기간 2~5일 토,일 공휴일 제외\n제품에 따라 제작 시 1~2일 추가\n소요 될 수 있습니다.', 18900, 24, 'N', 'N', '925실버 스네이크 체인 두줄 은발찌', 25000, 99, 26, 1);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (51, '2025-03-07 22:13:41', '2025-03-18 22:28:17', 'Y', 'Y', '4921712482', b'0', '•-•-•-•-•-•-•-•-•-•-•-•-•-•-•-•-•\n구슬공예 작가\n체리비즈🍒 입니다\n•-•-•-•-•-•-•-•-•-•-•-•-•-•-•-•-•\n\n\n\nM103.발찌_부엉이실버참 은볼발찌\n\n\n\n지혜와 부, 명예를 상징하는\n예쁜 부엉이 참을 장식해,\n\n의미도 있고 예쁘기도 한\n사랑스런 발찌 선보입니다 ~^^♡\n\n\n★ 반제품으로 나오는 군번줄\n실버체인과는 확연하게 다릅니다\n비달론사 와이어 또는 925실버체인에 3mm 은볼을\n한알한알 꿰어주고 마감 해서\n라인이랑 실버볼 자체의 은은한 반짝임이\n너~무도 예쁜 발찌 랍니다 ★\n\n\n※ 사이즈 재는 법 참고 하세요 ~\n줄자가 있으면 좋겠지만 없어도 무방 합니당 ㅎ\nA4용지를 잘라 폭 1cm 정도의\n띠로 만들어 주시구요\n시작부분 별표시 해두고 둘레를 잰 후\n끝부분 체크해서 자로 그 길이를 재시면 됩니다', 63500, 0, 'N', 'N', 'M103.발찌_부엉이은참 은볼발찌', 63500, 99, 26, 1);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (50, '2025-03-07 22:13:41', '2025-03-18 22:28:17', 'Y', 'Y', '2944080020', b'0', '은은한 존재감과 편안한 착용감.\n모던한 디자인가지 세 가지 장점을 지니고 있습니다.\n[시르끌로] 의 은은한 아름다움은 당신의 발목을 감싸\n실버의 빛이 부드럽게 반짝이며 조화를 이룹니다.', 15000, 30, 'N', 'N', '[시르끌로 실버발찌] 은은하지만 확실한 존재감', 21500, 99, 26, 1);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (49, '2025-03-07 22:13:40', '2025-03-18 22:28:17', 'Y', 'Y', '2324322376', b'0', '꽃모양 진주와 크리스탈이\n사랑스러운 디자인의 발찌입니다 :)\n\n취향에 맞게 선택하실 수 있게\n세련된 블랙\n청순한 블루\n두가지 컬러로 제작했어요\n\n꼬리체인에는 앙증맞은 진주로\n사랑스러운 포인트를 더했습니다🫧\n\n전체 써지컬스틸 소재로\n편안하게 착용 가능하세요\n\n\n\n🪞\n소재\n\n써지컬스틸 (모든 금속부분)\n아크릴진주\n크리스탈\n\n\n🪞\n사이즈\n\n꽃 지름 약 8.5mm', 15000, 11, 'N', 'N', '[NEW] 플로라 써지컬 발찌/팔찌', 17000, 99, 26, 1);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (48, '2025-03-07 22:13:39', '2025-03-18 22:28:17', 'Y', 'Y', '1304576636', b'0', '좋아하는 작가 ❤ 누르시면\n매달 더 많은 할인쿠폰 및 이벤트\n소식들을 받아보실 수 있습니다😆\n\n\n깔끔하면서도 베이직한 디자인의 팔찌(발찌)\n심플한 디자인이라 어떠한 룩에도 어울립니다~\n\n하나만 착용하셔도 세련되고 은은하게\n포인트 주기 좋은 아이템이에요:)\n다른 팔찌와 레이어드 하기에도 좋아\n다양한 스타일로 연출하기 좋고,\n가늘어 보이는 효과까지 더해줍니다.\n\n데일리 팔찌(발찌)로 추천해 드리고\n싶은 아이템에요~\n\n소재\nSILVER 92.5% / 14k gold plated\n\nSize\n팔찌-줄길이 16cm + 4cm(여유분 줄)\n발찌-줄길이 22cm + 3cm(여유분 줄)\n\n여유분 줄이 있어 길이 조절도 가능해서\n사용하시기 편리합니다~\n\nColor\n실버, 로즈골드\n\n\n🚚 배송\n배송기간 2~5일 토,일 공휴일 제외\n제품에 따라 제작 시 1~2일 추가\n소요 될 수 있습니다.', 9900, 38, 'N', 'N', '925실버 베이직 심플 체인팔찌,발찌', 16000, 99, 26, 1);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (47, '2025-03-07 22:13:35', '2025-03-18 22:28:17', 'Y', 'Y', '7309202877', b'0', '난다 핸드메이드\n\n이니셜 은팔찌 1mm매듭발찌는\n남자분들도 부담없이 착용하실수 있게 굵은실로 제작된\n심플한 디자인에 은 이니셜이 움직일때마다\n반짝거리는 예쁜 팔찌,발찌입니다.\n편한 착용감으로 데일리 아이템으로 좋아요.\n\n우정발찌로 나누어 껴도좋고\n커플끼리 착용하셔도 의미있는\n아주 좋은 상품 입니다 ^^\n옵션에서 발찌, 팔찌 선택 할수 있습니다.\n\n✔️심플 은볼팔찌는 데코상품입니다\n\n‼️싸이즈는 주문하실때 배송 요청란에 🙏🏻‼️\n손목 또는 발목 둘레를 적어 주세요.\n적어주시면 예쁘게 맞는 싸이즈로 제작해서 보내 드립니다.\n❌메세지로 따로 싸이즈 보내주시면 착오가생겨요😭❌\n\n재료\n폴리매듭실 블랙,레드\n이니셜 9mm (92.5%은)\n은고리(92.5%/은/도금)\n\n원산지\n대한민국\n\n사이즈\n팔찌', 20500, 2, 'N', 'N', '이니셜발찌 1mm매듭발찌', 21000, 99, 26, 1);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (46, '2025-03-07 22:13:34', '2025-03-18 22:28:17', 'Y', 'Y', '5901019262', b'0', '핸드메이드 실버주얼리 "민씨언니"입니다\n\n\n🌵\n\n어떤유닛과 어떤체인이\n어울릴지 많이 고민해서 제작한 체인발찌!!\n\n\n어느 코디에도 다 잘 어울리는 체인발찌!\n원하는 유닛의 모양으로 원하는 각인 문구까지\n나만의 발찌를 제작해드립니당!!\n\n커플발찌, 우정발찌, 특별하게 선물하기 좋은 체인발찌!\n\n삼각, 원형, 하트, 육각 4가지 유닛모양\n데일리로는 역시 민씨언니 :)\n\n여유체인이 없는 발찌이므로,\n주문주실때 자신의 발목에서\n1-1.5센치 정도의 여유를 주시고 주문부탁드립니다:)\n\n\n지인분들이나, 여자친구,우정발찌로 어떠신가요?😊\n\n\n🌵\n\n소재 : 925 실버\n\n\n\n#모든 작업은 하나하나 수작업으로 조금의 차이는 있을수 있으며, 주문하실때는 여유를 두고 주문해주세요:)', 67000, 6, 'N', 'N', '핸드메이드 실버 유닛 체인발찌🌵', 72000, 99, 26, 1);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (45, '2025-03-07 22:13:33', '2025-03-18 22:28:17', 'Y', 'Y', '7680180116', b'0', 'No 알러지 / No 변색\n\n\n\n예쁜 컬러만 초이스한\n스와로브스키 정품 스톤을 만나실 수 있는\n2줄 스왈 발찌❤\n\n\n업데이트 되어있는 < 하트시그널 발찌 >와 동일하며\n팬던트만 스왈스톤으로 변경된\n디자인입니다 !\n\n\n데일리하고\n✔스와로브스키 스톤 특유의 고급스러움,\n반짝임\n\n(선물용으로도 너무 좋을 것 같네요)\n\n\n✔한 줄로 두줄 효과,\n\n두 줄의 길이를 다르게 제작하여\n착용 시, 가장 예쁜 레이어링을 선사합니다😌😌\n\n\n\n\n✔컬러는 6가지 - 사진 속 컬러명을 잘 참고 부탁드려요🙏\n\n\n1. 크리스탈 - 일반큐빅컬러\n2. AB크리스탈 - 크리스탈 컬러베이스 위에 오로라반짝임\n3. 화이트오팔 - 상아색계열에 은은한 오팔빛\n4. 블루 - 쨍한블루\n5. 아메시스트 - 바이올렛컬러(탄생석2월)\n6. 진주 - 입체진주(탄생석6월)\n\n\n\n함께 코디된 스왈목걸이는\n옵션에서 선택시 할인된 가격으로 겟하실 수 있어요😉\n\n\n\n\n✔총길이\n발찌 19~24cm / 목걸이 42~47cm\n\n\n\n\n\n✔재질 _ 체인&모든 자재 써지컬스틸(316)\n\n써지컬스틸(316)⁉️\n15개의 써지컬등급 중 인체에 무해하고 부식되지않아\n신체에 착용가능한 등급입니다\n\n\n\n\n✔️메인길이 변경을 원하시면 ?\n원하시는 수정길이를 기재해주세요😊\nex) 길이+1cm , 길이-1cm', 12000, 19, 'N', 'N', '써지컬스틸🤍스와로브스키 발찌/목걸이', 15000, 99, 26, 1);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (44, '2025-03-07 22:13:33', '2025-03-18 22:28:17', 'Y', 'Y', '9090625408', b'0', '나뭇잎의 특징을 살린 내추럴한 5가지 컬러로\n14K 골드필드와 정갈한 나뭇잎 매듭이 포인트입니다.\n단품, 레이어드 다 잘 어울리는 디자인으로\n다양한 연출이 가능한 매듭 발찌 입니다.\n\n- Color -\n\n1. Green - 선명한 그린컬러\n2. Evergreen - 다크그린 컬러\n3. Light Khaki - 라이트카키 컬러\n4. Olive - 애쉬 빛이 도는 올리브 컬러\n5. Olivine - 카키 컬러\n\n- Size -', 24500, 23, 'N', 'N', '🥝🫒 이브닝 페리도트 그린 터키석 목걸이&발찌🫒🥝', 32000, 99, 26, 1);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (43, '2025-03-07 22:13:31', '2025-03-18 22:28:17', 'Y', 'Y', '7430139367', b'0', '[Idus단독][1:1맞춤제작][靑煥 청환]\n월광석 염주\n\n보정없이 모두 자연광에서 촬영하였습니다.', 39750, 11, 'N', 'N', '[청환] 월광석 스트레스해소 행운 원석 염주 팔찌', 45000, 99, 25, 1);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (42, '2025-03-07 22:13:31', '2025-03-18 22:28:17', 'Y', 'Y', '8003026468', b'0', '⚜17공간의 모든 상품은 주문즉시 만들기 때문에\n완제품이 없습니다.\n최대한 꼼꼼히, 정성을 들여 만들이 드리고 싶습니다.\n충분한 여유를 가지시고 주문 부탁드립니다🙏\n\n卍\n\n[ 賢松 현송 ] 소나무 원목 염주\n\n천연 원목의 아름다움.\n소나무로 만든 염주로,\n어벤츄린, 오닉스, 호안석, 자마노, 수정\n원석 행운부를 넣었습니다.\n\n[ 소나무의 의미 ]\n\n올곧음, 단단한 믿음,\n장수, 지조, 번성,\n굳은 마음과\n변치 않는 절개입니다.\n\n🌕 어벤츄린의 의미\n"통찰력의 돌"이라 불리는\n어벤츄린은\n사고력, 지성, 인내심을 길러주며,\n트라우마, 스트레스, 노이로제를 치유해주는\n작용을 하고 있어, 소지하고 있으면\n부정적인 것들(환경, 마음등)을\n좋은 방향으로 이끌어준다고 합니다.\n\n🌕 호안석의 의미\n호랑이의 눈이라고 불리는 호안석은\n어두운 곳에서도 트인 눈으로\n꿰뚫어 본다는 뜻과\n현명한 통찰력,\n그로인해 쌓이는\n재물이란 의미가 있습니다.\n\n🌕 오닉스 원석의 의미\n평온, 우정, 청결, 건강을 의미 합니다.\n\n🌕 수정의 의미\n수정은 회복의 원석으로,\n긴장감을 해소해주고,\n영혼에 좋은 기운을\n넣어준다고 합니다.\n총명, 행복의 뜻이 있습니다.\n\n🌕 (자)마노의 의미\n말의 영석한 두뇌를 뜻하는 마노는\n순발력, 영리함, 생명력,\n가정의 평화를 의미하며,\n외국에서는 아게이트라 불리웁니다.\n아게이트는 긴 세기동안\n행운의 돌로 불리우며,\n몸에 지니고 있으면\n사람들의 의견을 납득시킨다고\n믿고있습니다.\n\n🌕청사금석의 의미\n침착함을 지켜주는 푸른 기운이\n사람들을 주위에 모이게 하는\n효과가 있습니다.\n벽조목과 닮은 뜻의\n재물, 건강, 성공, 명예 입니다.', 39750, 11, 'N', 'N', '賢松현송 소나무 나무 염주 단주 원석 불교 원목 팔찌', 45000, 99, 25, 1);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (41, '2025-03-07 22:13:30', '2025-03-18 22:28:17', 'Y', 'Y', '0487886393', b'0', '뱅글 팔찌의 약 70% 정도의 길이의\n짧은 뱅글과 체인을 연결하여\n\n심플하고 세련된 뱅글의 장점을 살리고\n팔목에 끼울때 뺄때 불편한 뱅글의 단점은\n\n체인으로 보완하여 세련되고 유니크한\n반 뱅글 팔찌를 디자인 해 만들었답니다.\n\n뱅글의 몸체에 반 무광 처리하여 은은하게\n고급스러움을 살린 가공을 해서\n은의 고유의 빛깔이 돋보여\n아주 매력적으로\n느껴집니다.\n\n정말 장신구 OAK 를 대표할만한\n자신있는 디자인 이며\n\n작가인 저 스스로는 1등 원픽의\n팔찌로 손꼽히는 ~~\n봐도 봐도 질리지 않는 세련된 팔찌 입니다.\n\n가볍고 휘어지는 얇은 두께가 결코 아니며\n휘어질수 없는 단단한 두께에\n제법 중량감이 있는\n고급진 느낌으로 연출해 보시기 바랍니다.\n\n여성과 남성 모두에게\n이리 잘 어울릴수 있을까요 ~~^^\n\n여성이 했을때는 여성의 팔찌인데\n또 남성이 하면 완전 남성의 팔찌로 보이는 마법이~\n\n커플 팔찌로 선택 하신다면 아주\n만족 스로우실 거예요!\n\n레이어드 착용시에도 얼마나 멋스럽고\n세련되게 어울리는지 몰라요~~^^\n\n발렌타인데이와 화이트 데이~\n기념일과 생일 선물로 어떨까요 ~~~?', 83000, 1, 'N', 'N', '반 뱅글 실버 팔찌', 84000, 99, 25, 1);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (40, '2025-03-07 22:13:29', '2025-03-18 22:28:17', 'Y', 'Y', '6507912535', b'0', '여성평균 손목사이즈를 기준으로 제작되었고\n사이즈 조절이 가능한 팔찌입니다.\n\n손목둘레에 따라 아래 사진과 같이\n조절끈 부분의 길이가 다를 수 있습니다.\n📦 배송관련안내\n\n배송은 13시 이전 주문은 최대한 빠르게 제작해\n당일 발송으로 보내드리려하는데\n13시 이후 들어오는 주문은 (주말, 공휴일을 제외) 다음날 출고됩니다.\n\n주문이 들어오는 순서대로 순차적으로 제작하는데\n핸드메이드 제품이라 주문량이 많으면 출고가\n최대 2일 이상도 걸릴 수 있습니다.\n\n최대한 여유 있는 주문 부탁드리고\n빨리 받고자 하신다면 주문 전 메세지 남겨주시면\n출고가능 날짜 알려드리도록 하겠습니다.\n궁금하신게 있으시다면 언제든지\n작가 문의 메시지를 남겨주세요.\n💌', 8100, 9, 'N', 'N', '🌺 동백꽃 매듭 팔찌 🌺', 9000, 99, 25, 1);
