INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (26, '2025-03-07 22:13:16', '2025-03-18 22:28:17', 'Y', 'Y', '0452003244', b'0', '✔️Title\n가넷\n이어링 & 피어싱\n\n✔️Material\nAll Silver925\nGarnet-CZ\n+18K Vermeil\n\n✔️Size:\n1.5, 2, 2.5, 3, 4, 5mm\n침두께 0.9mm\nl\nOval 5x7mm\n(*침형귀걸이만 주문 가능합니다)\nI\n볼피어싱 바두께1mm(보통굵기)\n볼피어싱 바길이 4,6,8mm +볼3mm\nI\n인터널(라블렛)피어싱\n바두께1.2mm(두꺼운편)\n헤트탭길이4mm+파이프탭6mm\n\n✔️\n피어싱 낱개1개 한세트\n1pcs_1set 🩵\nI\n이어링 낱개2개 한세트\n2pcs_1set 🩷\n\n🪧\n작품에 대해 더 궁금하신 점\n언제든지 메세지로 남겨주시면\n친절하게 답변 드리도록 하겠습니다✉️', 23000, 0, 'N', 'N', '1월탄생석💎가넷 사이즈,침형별,실버925피어싱&귀걸이', 23000, 99, 24, 1);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (25, '2025-03-07 22:13:15', '2025-03-18 22:28:17', 'Y', 'Y', '6025006459', b'0', '♥작가로 추가시 더 많은\n이벤트 정보를 받아 보실 수 있어요~\n\n----------------------------------------------------\n\n써지컬 스틸은 의료용으로 많이 사용되는\n합금으로 알러지 반응이 거의 없어\n예민한 피부, 알러지가 있는 분들이\n착용하시기에 적합한 소재입니다.\n\n내구성이 좋아 일상생활에서 땀 또는\n습기에 의해 부식이 거의 없어 활동에\n제한이 없는 제품입니다.\n----------------------------------------------------\n\n아주 기본적인 디자인으로\n깔끔하게 착용하기 좋고\n레이어드용으로 많이 활용되어\n하나쯤은 꼭 있어야 할 아이템이에요.\n\n연예인들도 데일리로 많이 착용하는 귀걸이.\n\n심플한 디자인이지만,\n포인트가 되는 귀걸이에요.\n.사이즈 별로 레이어드해 착용하셔도\n스타일리쉬한 느낌을 준답니다.\n\n---------------------------------------------------\n\n■PRODUCT INFO■\n\n링 사이즈\n특대: 65mm\n대: 55mm\n중: 45mm\n*사이즈추가*중소 : 25mm (원터치방식)\n소: 20mm (원터치방식)\n특소: 15mm (원터치방식)\n(링두께):2mm\n\n타입 : 귀걸이\n\n소재 : 써지컬스틸\n취급시주의사항:\n큰 압력을 가하면 제품손상을 일으킬 수 있으니 취급에 주의해 주시기 바랍니다.\n\n문의사항은 언제든 부담없이 연락주세요', 9000, 0, 'N', 'N', '써지컬링 레이어드 귀걸이', 9000, 99, 24, 1);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (24, '2025-03-07 22:13:15', '2025-03-18 22:28:17', 'Y', 'Y', '8485725508', b'0', '원터치 링 귀걸이는 올릴 때마다 좋아해 주시는 아이템인데\n민자 링 귀걸이 찾으시는 분들이 계셔서\n이번에 준비해 봤습니다.\n\n원터치 링 귀걸이가 탈착이 쉽다 보니\n많이들 선호하시더라고요 : )\n\n귀걸이를 한번 착용하면 잘 안 빼는 저 같은 사람은\n착용하고 자도 불편함이 없어서 좋았고\n또 무조건 외출 후엔 귀걸이는 빼야 한다는 분들도\n탈착이 쉽기 때문에 추천드립니다.\n\n두께는 약 2.5mm로 동일하며 \n지름은 약 1.6cm(M사이즈), 2cm(L사이즈) 두가지입니다.\n\n도톰한 두께감이 있어 고급스러우면서도\n캐주얼한 느낌을 주며\n착용 시 무겁지 않지만 포인트를 줄 수 있답니다 ^^\n\n아무래도 원터치 형식으로 만들다 보면\n공정이 더 들어가게 되니\n시간도 더 많이 소요되고\n가격이 조금 올라갈 수밖에 없는지라\n\n요 정도 사이즈의 링 귀걸이는 파이프형으로만\n보여드렸었는데\n메시지로 문의하시는 분들이 꽤 많이 계셔서\n준비해 봤어요 : )\n\n상세 사이즈, 상세 컷, 착용 컷 모두 참고하셔서\n신중한 구매하시길 부탁드리겠습니다.\n\n데일리로 착용하기 좋은 귀걸이 찾으시는 분들께\n아주 추천드립니다^^', 28025, 5, 'N', 'N', '92.5실버 - 노멀 원터치 링귀걸이', 29500, 99, 24, 1);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (23, '2025-03-07 22:13:14', '2025-03-18 22:28:17', 'Y', 'Y', '6256352611', b'0', '커플링 전문 제조 공방\n커플링 공작소에 오신 것을 환영합니다. ​🙂🙂\n\n\n\n✨ ride or die ✨\n\n흔들리지 않는 사랑, 헌신을 의미하는 말입니다.\n사랑하는 사람들이 항상 같이하기를 바라는 마음에서\n"같이 가거나 죽거나"\n어떤 어려움도 함께 기꺼이 헤쳐나가길 바라는 마음에서\n작품의 이름을 이렇게 정했습니다.', 8900, 0, 'N', 'N', '무배🦋나비 각인 써지컬 목걸이', 8900, 99, 24, 1);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (22, '2025-03-07 22:13:13', '2025-03-18 22:28:17', 'Y', 'Y', '3582364509', b'0', '좋아하는 작가 ❤ 누르시면\n매달 더 많은 할인쿠폰 및 이벤트\n소식들을 받아보실 수 있습니다😆\n\n\n정교한 다이아몬드 컷팅의 큐빅으로 화사한\n느낌을 주는 십자가 목걸이 입니다\n은은한 실버 색상과 화이트 큐빅 세팅으로,\n빛을 받으면 맑고 깨끗하게 빛이나\n하나만 착용하셔도 존재감이 돋보이는\n아름다운 목걸이랍니다~\n데일리로 추천해드리며, 두 가지 팬던트를\n같이 착용하시는 것을 강력 추천해드려요:)\n\nMaterial : 92.5 silver, 지르코니아 큐빅\n\nSize\n목걸이줄 : 41cm / 45cm / 50cm\n1번 십자가 : 9.5x14.5mm\n2번 십자가 : 9x11mm\n\n착용했을때 더 맑고 예쁜 목걸이랍니다:)\n\n\n🚚 배송\n(배송기간 1~3일) 토,일 공휴일 제외\n제품 주문 양에 따라 빠르면 당일 발송해드려요.\n\n\n⭐실버 제품 구매 전 꼭 확인해주세요⭐\n\n-925 실버 핸드메이드 특성상 본딩 자국이나 미세한\n스크래치, 이음새 땜 자국 등 제작 과정에서\n조금씩 발생할 수 있는 점 양해 부탁드려요.\n\n-제품 포장 시 녹화 후 발송해드립니다.\n\n-구매 후 제작되는 제품이라 단순변심에 의한\n교환,환불은 어려우며 작가에게\n가능여부를 문의해주세요.', 22000, 29, 'N', 'N', '925실버 맑은 십자가 목걸이', 31000, 99, 24, 1);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (21, '2025-03-07 22:13:12', '2025-03-18 22:28:17', 'Y', 'Y', '3410761431', b'0', '영롱하고 신비스러운 블루톤의\n아둘라레센스가 아름답게 감싸는\n높은 등급의 레인보우 문스톤을 소개합니다.😁\n\n아유리 광택을 지닌 문스톤은\n전체적으로 달빛처럼 유백색을 띠며,\n표면에세 블루톤의 변채가 나타나요.\n레인보우 문스톤의 독특한 광학적 효과는\n각 스톤마다 다르며, 자연에서 온 천연 보석인 만큼\n완벽하게 동일하지 않습니다.\n주로 하늘색, 파랑색, 남색 등\n다양한 블루 계열의 컬러톤을 감상하실 수 있어요.\n\n6월의 탄생석 중 하나인 문스톤은\n인도에서 성스럽고 신비한 돌로 여겨지며,\n다른 문화에서는 연인들의 돌로 불리기도 해요.\n제가 세팅하는 스톤은 준보석급의 뛰어난 문스톤으로,\n크랙이 잘 보이는 특성이 있습니다.\n이는 문스톤의 자연적인 특성으로,\n블루 계열의 컬러들이 각도에 따라\n육안으로 감상할 수 있는 스톤을 중심으로 선택하였으며.\n작품마다 고유의 블루톤 광채를 느끼실 수 있습니다.\n\n\n크랙과 인클루션(내포물)은 광물이 형성되는 과정에서\n자연스럽게 생기는 현상으로,\n이는 불량이 아님을 알려드립니다.', 54900, 1, 'N', 'N', 'AAA등급 블루빛 레인보우문스톤 목걸이&반지 🧃', 55900, 99, 24, 1);
