INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (18, '2025-03-07 22:13:09', '2025-03-18 22:28:17', 'Y', 'Y', '2917671018', b'0', '⚜️ 우아한 드레시 스왈진주 드롭 귀걸이 ⚜️\n\n\n여리여리하고 심플한거 좋아하시는\n우리 펄팸님들 취향저격 귀걸이 아닐까싶어요.\n기존 [심플 드레시 스왈진주 귀걸이]의 2탄!!\n진주 드롭 버전으로\n살랑이며 떨어지는 925실버 실키체인에\n아래 스왈진주가 더해져 더욱 우아하고 차분하며\n엘레강스한 느낌까지 느끼실 수 있답니다.\n데일리로도 부담없이 착용하실 수 있도록\n적당한 기장감으로 제작해 한듯 안 한듯 정말 가벼워요.\n출근룩, 하객, 면접용으로 추천드리는 귀걸이입니다.', 48600, 9, 'N', 'N', '옥 원터치 실버 링 귀걸이 | Jade Earring', 54000, 99, 23, 1);
