INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (16, '2025-03-07 22:13:07', '2025-03-18 22:28:17', 'Y', 'Y', '5212862065', b'0', '어제도 열심히 작업했어요!\n새벽까지 해서 겨우 빅사이즈 구형 바로크진주 비드목걸이 4줄을 만들었어요. (10-14mm)\n그래서 이번에 착한 big 사이즈 비드목걸이 4개만 open할 예정이에요.\n선별 천공 제작과정 다 생각보다 오래 걸렸어요.\n\n실제로 보시면 생각보다 큰 사이즈예요. 무게는 약 80g 내외\n빅사이즈라 흠집이 있지만 착용하고 계실 때 일반적인 거리에서는 거의 눈에 띄지 않아요.\n이 가격대에는 나올 수 없은 퀄리티에요!\n\n흠집에 민감하신 분께는 비추해드릴 수밖에 없지만,\n바로크진주의 특징과 시중의 가격대를 잘 알고 계신분들께는 정말 강추예요!\n\n비드 실은 일본산 프리미엄 진주 전용 실을 사용했고요,\n고리는 925실버 백금도금이에요.\n구형바로크\n담수진주10-14mm내외\n진주 사이사이마다 매듭 작업을 해서 착용감이 더 좋아요.\n45cm 2줄 / 46cm 2줄 준비했어요.\n\n이 목걸이는 커스텀 주문을 받지 못 해요 ㅠㅠ 이가격대 이 아이들보다 더 좋게 만들기 어려워요.\n펄베리의 정성이 최대한 들어갔다고 봐주시면 감사하겠습니다!', 214000, 2, 'N', 'N', '특가 바로크진주비드목걸이 담수진주 10-14mm', 219000, 99, 23, 1);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (15, '2025-03-07 22:13:06', '2025-03-18 22:28:17', 'Y', 'Y', '5176354879', b'0', '하단의 ❤팔로우❤를 눌러주세요!\n깜짝할인, 쿠폰지급, 선착순나눔 이벤트 소식을\n받아보실 수 있습니다:)\n\n🫶🏻물감하트🫶🏻귀걸이/피어싱\n\n물감 한방울 톡 떨어트린듯한 색감의 팬던트 입니다✨\n은은한 색감이라 데일리로 추천해드려요:)\n무금속 팬던트라 알러지/변색 없이 가볍게 착용하실 수 있습니다☺️\n\n✨\n\n피어싱자리에 붓고 염증이나도 뚫은게 아까워서 아픔을 참고 못빼고 계신분들 많죠?\n\n저 역시 살튀땜에 고생하다 실리콘피어싱으로 바꾼 후 살튀가 없어져서 강추하는 피어싱이랍니다!\n\n실리콘피어싱은 염증 치료용으로도 많이 쓰이고 있어요!\n\n써지컬,실버,14k 다 써봐도 염증이 없어지지 않는다면,\n\n한번이라도 살튀 경험이 있다면 실리콘 피어싱을 추천해드립니다.', 3920, 10, 'N', 'N', '물감하트🫶🏻피어싱/귀걸이', 4400, 99, 23, 1);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (14, '2025-03-07 22:13:06', '2025-03-18 22:28:17', 'Y', 'Y', '5799063678', b'0', 'since 2010\n하나 하나 손수 직접 제작하는\n핸드메이드 공방 "쁘띠메이"입니다.\n쁘띠메이에서 사용되는 부자재는\n하이퀄리티 천연원석과 법정 순은 실버925,\n카렌실버, 타이실버, 14K 골드필드(USA인증), 등\n인증된 고품질 소재로\n품질 및 금속알러지 걱정을 덜어드립니다.\n🎁 쁘띠메이를 좋아하는 작가로 "팔로우" 하시고\n신상할인과 각종 이벤트소식을\n누구보다 빠르게 만나보세요.. 🎁\n\n🔸️시중에 판매되는 침만 실버로 제작된\n저렴한 제품과 달리 제품 전체가 "실버925 정은,\n14Kgf로 제작된 귀걸이 입니다.\n🔸️귓볼이 두껍거나 얇으신 분은\n요청사항에 남겨주세요.', 16100, 30, 'N', 'N', '🍀후기인정🍀사랑을 불러오는 장미수정 귀걸이', 23000, 99, 23, 1);
INSERT INTO `product` (`id`, `created_at`, `modified_at`, `approval_status`, `best`, `code`, `del_flag`, `description`, `discount_price`, `discount_rate`, `event`, `is_new`, `name`, `price`, `stock_number`, `category_id`, `shop_id`) VALUES (13, '2025-03-07 22:13:05', '2025-03-18 22:28:17', 'Y', 'Y', '9983622808', b'0', '🌙 무광 못난이 오로라귀걸이🌙\n\n\n맘딸의 인기귀걸이인 \' 못난이오로라 \'를\n무광 버전으로 제작했습니다\n\n못난이 오로라 유리에\n맘딸만의 특수한 공법으로\n표면을 매트하게 제작했어요\n\n기존의 못난이 오로라가\n쨍하고 영롱하다면\n무광 버젼은 매트한 표면에 의해\n여러가지 색감이 은은히\n어우러지게 보이며\n물에 촉촉히 젖은 듯\n신비롭고 고급스러운 느낌을 가지고있습니다\n\n둥그런 네모 , 세모 ○ ▲ □\n올록볼록하게 비정형 모양으로 제작되며\n양쪽 모양과 색감은 언발란스합니다\n\n🔆 각도에 따라서, 조명에 따라서\n조금씩 달라보이는 색감이\n오묘하고 신비롭습니다\n사진은 햇빛을 정면으로 받은 모습입니다', 40410, 9, 'N', 'N', '12탄생석 라일락오팔 데일리 원터치링 미니멀룩 귀걸이', 44900, 99, 23, 1);
